import{_ as e,c as a,o as t,U as i}from"./chunks/framework.XIocvv-P.js";const u=JSON.parse('{"title":"System Variables v220801","description":"","frontmatter":{"layout":"doc","outline":"deep"},"headers":[],"relativePath":"technical_docs/system_variables.md","filePath":"technical_docs/system_variables.md"}'),r={name:"technical_docs/system_variables.md"},o=i('<h1 id="system-variables-v220801" tabindex="-1">System Variables v220801 <a class="header-anchor" href="#system-variables-v220801" aria-label="Permalink to &quot;System Variables v220801&quot;">​</a></h1><br><h4 id="_1-glob-pin-0-glob-pin-39" tabindex="-1">1. GLOB_PIN_0 ~ GLOB_PIN_39 <a class="header-anchor" href="#_1-glob-pin-0-glob-pin-39" aria-label="Permalink to &quot;1. GLOB_PIN_0 ~ GLOB_PIN_39&quot;">​</a></h4><p>Variables that store the position and orientation (location and rotation) of global Points saved in the system.<br> (Type: Point)</p><h4 id="_2-glob-pin-0-j-glob-pin-39-j" tabindex="-1">2. GLOB_PIN_0_J ~ GLOB_PIN_39_J <a class="header-anchor" href="#_2-glob-pin-0-j-glob-pin-39-j" aria-label="Permalink to &quot;2. GLOB_PIN_0_J ~ GLOB_PIN_39_J&quot;">​</a></h4><p>Variables that store the joint angle values of global Point saved in the system (Unit: Degree).<br> (Type: Joint)</p><h4 id="_3-rom-0-9" tabindex="-1">3. _ROM_0~9 <a class="header-anchor" href="#_3-rom-0-9" aria-label="Permalink to &quot;3. \\_ROM_0~9&quot;">​</a></h4><p>Non-volatile data stored in the system, meaning the values are retained even if the program ends or the controller power is turned off.</p><h4 id="_4-gdata-0-19-global-0-19" tabindex="-1">4. _GDATA_0~19 (_GLOBAL_0~19) <a class="header-anchor" href="#_4-gdata-0-19-global-0-19" aria-label="Permalink to &quot;4. \\_GDATA_0~19 (\\_GLOBAL_0~19)&quot;">​</a></h4><p>Default global variables set in the system that can be used across all programs.<br> _GDATA_0~19and _GLOBAL_0~19 are the same variables stored in the same area.</p><h4 id="_5-sd-mod-user-0-127-sd-mod-addr-128-255" tabindex="-1">5. SD_MOD_USER_0~127 (SD_MOD_ADDR_128~255) <a class="header-anchor" href="#_5-sd-mod-user-0-127-sd-mod-addr-128-255" aria-label="Permalink to &quot;5. SD_MOD_USER_0~127 (SD_MOD_ADDR_128~255)&quot;">​</a></h4><p>When the robot acts as a ModbusTCP server, this is the area available for user usage.<br> This variable is in the Word (16-bit) area and can represent values up to 65,536 (216).<br> SD_MOD_USER_0~127 and SD_MOD_ADDR_128~255 are the same variables stored in the same area.<br> For example, the value at address 128 corresponds to SD_MOD_USER_0 or SD_MOD_ADDR_128.</p><h4 id="_6-sd-modbus-client-num" tabindex="-1">6. SD_MODBUS_CLIENT_NUM <a class="header-anchor" href="#_6-sd-modbus-client-num" aria-label="Permalink to &quot;6. SD_MODBUS_CLIENT_NUM&quot;">​</a></h4><p>When the robot acts as a ModbusTCP server, this variable indicates the number of connected clients.</p><h4 id="_7-sd-timer-0-9" tabindex="-1">7. SD_TIMER_0~9 <a class="header-anchor" href="#_7-sd-timer-0-9" aria-label="Permalink to &quot;7. SD_TIMER_0~9&quot;">​</a></h4><p>Variables representing time, allowing control of up to 9 separate timers.<br> Timers can be selected and initialized through the Set-Timer Setting in the Make window.<br> During program execution, the time increases automatically and is mainly used for timer functions.</p><h4 id="_8-eip-int-r2p-0-19-eip-r2p-int-0-19" tabindex="-1">8. EIP_INT_R2P_0~19 (EIP_R2P_INT_0~19) <a class="header-anchor" href="#_8-eip-int-r2p-0-19-eip-r2p-int-0-19" aria-label="Permalink to &quot;8. EIP_INT_R2P_0~19 (EIP_R2P_INT_0~19)&quot;">​</a></h4><p>Variables used to transmit integer data to a PLC via Ethernet/IP communication.<br> EIP_INT_R2P_0~19 and EIP_R2P_INT_0~19 are the same variables stored in the same area.</p><h4 id="_9-eip-int-p2r-0-19-eip-p2r-int-0-19" tabindex="-1">9. EIP_INT_P2R_0~19 (EIP_P2R_INT_0~19) <a class="header-anchor" href="#_9-eip-int-p2r-0-19-eip-p2r-int-0-19" aria-label="Permalink to &quot;9. EIP_INT_P2R_0~19 (EIP_P2R_INT_0~19)&quot;">​</a></h4><p>Variables used to receive integer data from a PLC via Ethernet/IP communication.<br> EIP_INT_P2R_0~19 and EIP_P2R_INT_0~19 are the same variables stored in the same area.</p><h4 id="_10-eip-real-r2p-0-19-eip-r2p-real-0-19" tabindex="-1">10. EIP_REAL_R2P_0~19 (EIP_R2P_REAL_0~19) <a class="header-anchor" href="#_10-eip-real-r2p-0-19-eip-r2p-real-0-19" aria-label="Permalink to &quot;10. EIP_REAL_R2P_0~19 (EIP_R2P_REAL_0~19)&quot;">​</a></h4><p>Variables used to transmit floating-point data to a PLC via Ethernet/IP communication.<br> EIP_REAL_R2P_0~19 and EIP_R2P_REAL_0~19 are the same variables stored in the same area.</p><h4 id="_11-eip-real-p2r-0-19-eip-p2r-real-0-19" tabindex="-1">11. EIP_REAL_P2R_0~19 (EIP_P2R_REAL_0~19) <a class="header-anchor" href="#_11-eip-real-p2r-0-19-eip-p2r-real-0-19" aria-label="Permalink to &quot;11. EIP_REAL_P2R_0~19 (EIP_P2R_REAL_0~19)&quot;">​</a></h4><p>Variables used to receive floating-point data from a PLC via Ethernet/IP communication.<br> EIP_REAL_P2R_0~19 and EIP_P2R_REAL_0~19 are the same variables stored in the same area.</p><h4 id="_12-sd-j-ang" tabindex="-1">12. SD_J#_ANG <a class="header-anchor" href="#_12-sd-j-ang" aria-label="Permalink to &quot;12. SD_J#\\_ANG&quot;">​</a></h4><p>SD_J0_ANG<br> SD_J1_ANG<br> SD_J2_ANG<br> SD_J3_ANG<br> SD_J4_ANG<br> SD_J5_ANG<br></p><p>Variables representing the encoder angle values of the robot arm&#39;s joints.<br> (Unit: degree)</p><h4 id="_13-sd-j-cur" tabindex="-1">13. SD_J#_CUR <a class="header-anchor" href="#_13-sd-j-cur" aria-label="Permalink to &quot;13. SD_J#\\_CUR&quot;">​</a></h4><p>SD_J0_CUR<br> SD_J1_CUR<br> SD_J2_CUR<br> SD_J3_CUR<br> SD_J4_CUR<br> SD_J5_CUR<br></p><p>Variables representing the current values of the robot arm&#39;s joints.<br> (Unit: A)</p><h4 id="_14-sd-ext-axis" tabindex="-1">14. SD_EXT_AXIS_# <a class="header-anchor" href="#_14-sd-ext-axis" aria-label="Permalink to &quot;14. SD_EXT_AXIS\\_\\#&quot;">​</a></h4><p>SD_EXT_AXIS_0<br> SD_EXT_AXIS_1<br> SD_EXT_AXIS_2<br> SD_EXT_AXIS_3<br> SD_EXT_AXIS_4<br> SD_EXT_AXIS_5<br></p><p>Variables representing the command values for the external axis joints.<br> (Unit: degree)</p><h4 id="_15-sd-exj-ang" tabindex="-1">15. SD_EXJ#_ANG <a class="header-anchor" href="#_15-sd-exj-ang" aria-label="Permalink to &quot;15. SD_EXJ#\\_ANG&quot;">​</a></h4><p>SD_EXJ0_ANG<br> SD_EXJ1_ANG<br> SD_EXJ2_ANG<br> SD_EXJ3_ANG<br> SD_EXJ4_ANG<br> SD_EXJ5_ANG<br></p><p>Variables representing the encoder angle values of the external axis joints.<br> (Unit: degree)</p><h4 id="_16-sd-begin-j" tabindex="-1">16. SD_BEGIN_J# <a class="header-anchor" href="#_16-sd-begin-j" aria-label="Permalink to &quot;16. SD_BEGIN_J\\#&quot;">​</a></h4><p>SD_BEGIN_J0<br> SD_BEGIN_J1<br> SD_BEGIN_J2<br> SD_BEGIN_J3<br> SD_BEGIN_J4<br> SD_BEGIN_J5<br></p><p>Variables representing the joint angle values set at the Begin position.<br> (Unit: degree)</p><h4 id="_17-sd-tcp-x" tabindex="-1">17. SD_TCP_X <a class="header-anchor" href="#_17-sd-tcp-x" aria-label="Permalink to &quot;17. SD_TCP_X&quot;">​</a></h4><p>SD_TCP_X<br> SD_TCP_Y<br> SD_TCP_Z<br> SD_TCP_RX<br> SD_TCP_RY<br> SD_TCP_RZ<br></p><p>Variables representing the position and orientation of the TCP (Tool Center Point) relative to the base (global) coordinate system.<br> (Unit: mm &amp; degree)</p><h4 id="_18-sd-tcp-x-ref" tabindex="-1">18. SD_TCP_X_REF <a class="header-anchor" href="#_18-sd-tcp-x-ref" aria-label="Permalink to &quot;18. SD_TCP_X_REF&quot;">​</a></h4><p>SD_TCP_X_REF<br> SD_TCP_Y_REF<br> SD_TCP_Z_REF<br> SD_TCP_RX_REF<br> SD_TCP_RY_REF<br> SD_TCP_RZ_REF<br></p><p>Variables representing the position and orientation of the TCP relative to the base (global) coordinate system.<br> (Unit: mm &amp; degree)</p><h4 id="_19-sd-eft-fx" tabindex="-1">19. SD_EFT_FX <a class="header-anchor" href="#_19-sd-eft-fx" aria-label="Permalink to &quot;19. SD_EFT_FX&quot;">​</a></h4><p>SD_EFT_FX<br> SD_EFT_FY<br> SD_EFT_FZ<br> SD_EFT_MX<br> SD_EFT_MY<br> SD_EFT_MZ<br></p><p>Variables representing the sensor values received from the External Force Torque sensor.<br> FX, FY, FZ indicate force (N), while MX, MY, MZ represent torque (Nm).<br> The reference axes for X, Y, Z values follow the coordinate system of the sensor manufacturer.<br> (Unit: N, Nm)</p><h4 id="_20-sd-eft-f-size" tabindex="-1">20. SD_EFT_F_SIZE <a class="header-anchor" href="#_20-sd-eft-f-size" aria-label="Permalink to &quot;20. SD_EFT_F_SIZE&quot;">​</a></h4><p>Variables representing the magnitude of force (sum of the three axes) as measured by the External Force Transducer. (N)</p><h4 id="_21-sd-eft-m-size" tabindex="-1">21. SD_EFT_M_SIZE <a class="header-anchor" href="#_21-sd-eft-m-size" aria-label="Permalink to &quot;21. SD_EFT_M_SIZE&quot;">​</a></h4><p>This variable represents the magnitude of the moment torque (sum of the three axes) from the External Force Transducer (Nm).</p><h4 id="_22-sd-temperature-mc" tabindex="-1">22. SD_TEMPERATURE_MC# <a class="header-anchor" href="#_22-sd-temperature-mc" aria-label="Permalink to &quot;22. SD_TEMPERATURE_MC#&quot;">​</a></h4><p>SD_TEMPERATURE_MC0<br> SD_TEMPERATURE_MC1<br> SD_TEMPERATURE_MC2<br> SD_TEMPERATURE_MC3<br> SD_TEMPERATURE_MC4<br> SD_TEMPERATURE_MC5<br></p><p>This variable indicates the current temperature values of each joint in the robot.<br> (Unit: Celsius)</p><h4 id="_23-sd-power-state" tabindex="-1">23. SD_POWER_STATE <a class="header-anchor" href="#_23-sd-power-state" aria-label="Permalink to &quot;23. SD_POWER_STATE&quot;">​</a></h4><p>This variable manages the power management information of the controller at the bit level.</p><ul><li>SD_POWER_STATE &gt;&gt; 0 &amp; 0x01 : Indicates whether the 48V SMPS is operational.</li><li>SD_POWER_STATE &gt;&gt; 1 &amp; 0x01 : Power switching circuit operation information.</li><li>SD_POWER_STATE &gt;&gt; 2 &amp; 0x01 : Indicates whether the 24V SMPS is operational.</li><li>SD_POWER_STATE &gt;&gt; 3 &amp; 0x01 : 48V switching-line status.</li><li>SD_POWER_STATE &gt;&gt; 4 &amp; 0x01 : PC power switching operation status.</li><li>SD_POWER_STATE &gt;&gt; 5 &amp; 0x01 : E-stop switching operation status.</li></ul><h4 id="_24-sd-default-speed" tabindex="-1">24. SD_DEFAULT_SPEED <a class="header-anchor" href="#_24-sd-default-speed" aria-label="Permalink to &quot;24. SD_DEFAULT_SPEED&quot;">​</a></h4><p>This variable represents the default speed ratio. The UI speed control bar displays values between 0 and 1.</p><h4 id="_25-sd-robot-state" tabindex="-1">25. SD_ROBOT_STATE <a class="header-anchor" href="#_25-sd-robot-state" aria-label="Permalink to &quot;25. SD_ROBOT_STATE&quot;">​</a></h4><p>This variable indicates whether the robot is executing a motion command.</p><ul><li>1 = Idle</li><li>Others = Moving</li></ul><h4 id="_26-sd-task-run-state" tabindex="-1">26. SD_TASK_RUN_STATE <a class="header-anchor" href="#_26-sd-task-run-state" aria-label="Permalink to &quot;26. SD_TASK_RUN_STATE&quot;">​</a></h4><p>This variable indicates the basic state when a program is running.</p><ul><li>1 = Program not run / Idle</li><li>2 = Program is running</li><li>3 = Program I running + but ‘Paused’ state</li></ul><h4 id="_27-sd-collision-detect-state" tabindex="-1">27. SD_COLLISION_DETECT_STATE <a class="header-anchor" href="#_27-sd-collision-detect-state" aria-label="Permalink to &quot;27. SD_COLLISION_DETECT_STATE&quot;">​</a></h4><p>This variable represents the on/off status of the external collision detection feature.</p><ul><li>0 = External collision detection is off.</li><li>1 = External collision detection is on.</li></ul><h4 id="_28-sd-coll-during-move" tabindex="-1">28. SD_COLL_DURING_MOVE <a class="header-anchor" href="#_28-sd-coll-during-move" aria-label="Permalink to &quot;28. SD_COLL_DURING_MOVE&quot;">​</a></h4><p>This variable indicates whether a collision occurred during movement.<br> If there was a collision history during motion, the value of this variable will be 1.</p><h4 id="_29-sd-is-free-drive-mode" tabindex="-1">29. SD_IS_FREE_DRIVE_MODE <a class="header-anchor" href="#_29-sd-is-free-drive-mode" aria-label="Permalink to &quot;29. SD_IS_FREE_DRIVE_MODE&quot;">​</a></h4><p>This variable represents the status of the direct teaching mode.</p><ul><li>0 = Direct teaching is off.</li><li>1 = Direct teaching is on.</li></ul><h4 id="_30-sd-tfb-button" tabindex="-1">30. SD_TFB_BUTTON <a class="header-anchor" href="#_30-sd-tfb-button" aria-label="Permalink to &quot;30. SD_TFB_BUTTON&quot;">​</a></h4><p>This variable represents the status of the direct teaching button on the tool flange.</p><h4 id="_31-sd-pg-mode" tabindex="-1">31. SD_PG_MODE <a class="header-anchor" href="#_31-sd-pg-mode" aria-label="Permalink to &quot;31. SD_PG_MODE&quot;">​</a></h4><p>This variable represents the robot&#39;s operation mode.</p><ul><li>0 = Real mode</li><li>1 = Simulation mode</li></ul><h4 id="_32-sd-init-state-info" tabindex="-1">32. SD_INIT_STATE_INFO <a class="header-anchor" href="#_32-sd-init-state-info" aria-label="Permalink to &quot;32. SD_INIT_STATE_INFO&quot;">​</a></h4><p>This system variable indicates the activation stage information of the robot.</p><ul><li>0 = default</li><li>1 = Power check</li><li>2 = Device check</li><li>3 = Servo Initialization check</li><li>4 = Parameter check</li><li>5 = Payload check</li><li>6 = Activation done</li></ul><h4 id="_33-sd-init-err" tabindex="-1">33. SD_INIT_ERR <a class="header-anchor" href="#_33-sd-init-err" aria-label="Permalink to &quot;33. SD_INIT_ERR&quot;">​</a></h4><p>This system variable displays the activation error information of the robot.</p><h4 id="_34-sd-op-stat-collision-occur" tabindex="-1">34. SD_OP_STAT_COLLISION_OCCUR <a class="header-anchor" href="#_34-sd-op-stat-collision-occur" aria-label="Permalink to &quot;34. SD_OP_STAT_COLLISION_OCCUR&quot;">​</a></h4><p>This variable indicates whether a collision has occurred with the robot.</p><ul><li>0 = Idle</li><li>1 = External collision occurred</li></ul><h4 id="_35-sd-op-stat-sos-flag" tabindex="-1">35. SD_OP_STAT_SOS_FLAG <a class="header-anchor" href="#_35-sd-op-stat-sos-flag" aria-label="Permalink to &quot;35. SD_OP_STAT_SOS_FLAG&quot;">​</a></h4><p>This variable indicates whether there is an issue with the controller power, robot joint controller, or other problems.</p><ul><li>0 = None</li><li>1 = Encoder err (PVL)</li><li>2 = CPU err</li><li>3 = Big err</li><li>4 = Input err</li><li>5 = Jam eerr</li><li>6 = Over current err</li><li>7 = Position bound err</li><li>8 = Mode err</li><li>9 = Match err</li><li>10 = Over current/Low Voltage err</li><li>11 = Temperature err</li><li>12 = Speed over err</li></ul><h4 id="_36-sd-op-stat-self-collision" tabindex="-1">36. SD_OP_STAT_SELF_COLLISION <a class="header-anchor" href="#_36-sd-op-stat-self-collision" aria-label="Permalink to &quot;36. SD_OP_STAT_SELF_COLLISION&quot;">​</a></h4><p>This variable represents whether the robot has entered the self-collision range during operation.</p><ul><li>0 = Idle</li><li>1 = Entered self-collision range</li></ul><h4 id="_37-sd-op-stat-soft-estop-occur" tabindex="-1">37. SD_OP_STAT_SOFT_ESTOP_OCCUR <a class="header-anchor" href="#_37-sd-op-stat-soft-estop-occur" aria-label="Permalink to &quot;37. SD_OP_STAT_SOFT_ESTOP_OCCUR&quot;">​</a></h4><p>This variable indicates whether the robot (program) is in a pause state.</p><ul><li>0 = Idle</li><li>1 = Paused state</li></ul><h4 id="_38-sd-op-stat-ems-flag" tabindex="-1">38. SD_OP_STAT_EMS_FLAG <a class="header-anchor" href="#_38-sd-op-stat-ems-flag" aria-label="Permalink to &quot;38. SD_OP_STAT_EMS_FLAG&quot;">​</a></h4><p>This variable indicates when there is no answer from the robot position calculation algorithm or when the joint limit range has been reached.</p><ul><li>0 = None</li><li>1 = Arm Stretch</li><li>2 = Cartesian Limit</li><li>3 = Joint Limit</li><li>4 = Un-solvable</li></ul><h4 id="_39-sd-digital-in-config-0-sd-digital-in-config-1" tabindex="-1">39. SD_DIGITAL_IN_CONFIG_0, SD_DIGITAL_IN_CONFIG_1 <a class="header-anchor" href="#_39-sd-digital-in-config-0-sd-digital-in-config-1" aria-label="Permalink to &quot;39. SD_DIGITAL_IN_CONFIG_0, SD_DIGITAL_IN_CONFIG_1&quot;">​</a></h4><p>These two variables represent the information of the two safety stop terminals (Din 16 &amp; 17).</p><h4 id="_40-sd-inbox-trap-flag-0-1" tabindex="-1">40. SD_INBOX_TRAP_FLAG_0~1 <a class="header-anchor" href="#_40-sd-inbox-trap-flag-0-1" aria-label="Permalink to &quot;40. SD_INBOX_TRAP_FLAG_0~1&quot;">​</a></h4><p>This variable indicates whether an event set in Inbox mode has occurred.</p><h4 id="_41-sd-inbox-check-mode-0-1" tabindex="-1">41. SD_INBOX_CHECK_MODE_0~1 <a class="header-anchor" href="#_41-sd-inbox-check-mode-0-1" aria-label="Permalink to &quot;41. SD_INBOX_CHECK_MODE_0~1&quot;">​</a></h4><p>This variable represents the Inbox mode set when using the Inbox feature.</p><ul><li>0: No checking</li><li>1: Check Tool Flange Center (Monitors whether the center of the tool flange enters a specific area)</li><li>2: Check Tool Center Point (Monitors whether the set TCP enters a specific area)</li><li>3: Check Tool Box (Monitors whether a virtually set box enters a specific area)</li><li>4: Check All (Monitors whether the robot’s settings for the above three conditions enter a specific area)</li></ul><h4 id="_42-sd-analog-in-0-3" tabindex="-1">42. SD_ANALOG_IN_0~3 <a class="header-anchor" href="#_42-sd-analog-in-0-3" aria-label="Permalink to &quot;42. SD_ANALOG_IN_0~3&quot;">​</a></h4><p>This variable represents the values (0~10V) of the 4 analog input ports on the controller box.</p><h4 id="_43-sd-analog-out-0-3" tabindex="-1">43. SD_ANALOG_OUT_0~3 <a class="header-anchor" href="#_43-sd-analog-out-0-3" aria-label="Permalink to &quot;43. SD_ANALOG_OUT_0~3&quot;">​</a></h4><p>This variable represents the values (0~10V) of the 4 analog output ports on the controller box.</p><h4 id="_44-sd-digital-in-0-15" tabindex="-1">44. SD_DIGITAL_IN_0~15 <a class="header-anchor" href="#_44-sd-digital-in-0-15" aria-label="Permalink to &quot;44. SD_DIGITAL_IN_0~15&quot;">​</a></h4><p>This variable represents the values (0 or 1) of the 16 digital input ports on the controller box.</p><h4 id="_45-sd-digital-out-0-15" tabindex="-1">45. SD_DIGITAL_OUT_0~15 <a class="header-anchor" href="#_45-sd-digital-out-0-15" aria-label="Permalink to &quot;45. SD_DIGITAL_OUT_0~15&quot;">​</a></h4><p>This variable represents the values (0 or 1) of the 16 digital output ports on the controller box.</p><h4 id="_46-sd-digital-in-0-low-time-sd-digital-in-15-low-time" tabindex="-1">46. SD_DIGITAL_IN_0_LOW_TIME ~ SD_DIGITAL_IN_15_LOW_TIME <a class="header-anchor" href="#_46-sd-digital-in-0-low-time-sd-digital-in-15-low-time" aria-label="Permalink to &quot;46. SD_DIGITAL_IN_0_LOW_TIME ~ SD_DIGITAL_IN_15_LOW_TIME&quot;">​</a></h4><h4 id="_46-din-0-low-time-din-15-low-time" tabindex="-1">46. DIN_0_LOW_TIME ~ DIN_15_LOW_TIME <a class="header-anchor" href="#_46-din-0-low-time-din-15-low-time" aria-label="Permalink to &quot;46. DIN_0_LOW_TIME ~ DIN_15_LOW_TIME&quot;">​</a></h4><p>This variable records the time for which a given signal (Digital IN 0~15) remains at 0 (Low).<br> The timer resets when the signal goes from 1 (High) to 0 (Low) and can be used for timing purposes.</p><ul><li>SD_DIGITAL_IN_0_LOW_TIME and DIN_0_LOW_TIME are the same variables stored in the same region.</li></ul><h4 id="_47-sd-digital-in-0-high-time-sd-digital-in-15-high-time" tabindex="-1">47. SD_DIGITAL_IN_0_HIGH_TIME ~ SD_DIGITAL_IN_15_HIGH_TIME <a class="header-anchor" href="#_47-sd-digital-in-0-high-time-sd-digital-in-15-high-time" aria-label="Permalink to &quot;47. SD_DIGITAL_IN_0_HIGH_TIME ~ SD_DIGITAL_IN_15_HIGH_TIME&quot;">​</a></h4><h4 id="_47-din-0-high-time-din-15-high-time" tabindex="-1">47. DIN_0_HIGH_TIME ~ DIN_15_HIGH_TIME <a class="header-anchor" href="#_47-din-0-high-time-din-15-high-time" aria-label="Permalink to &quot;47. DIN_0_HIGH_TIME ~ DIN_15_HIGH_TIME&quot;">​</a></h4><p>This variable records the time for which a given signal (Digital IN 0~15) remains at 1 (High).<br> The timer resets when the signal goes from 0 (Low) to 1 (High) and can be used for timing purposes.</p><ul><li>SD_DIGITAL_IN_0_HIGH_TIME and DIN_0_HIGH_TIME are the same variables stored in the same region.</li></ul><h4 id="_48-sd-ex-analog-in-0-3" tabindex="-1">48. SD_EX_ANALOG_IN_0~3 <a class="header-anchor" href="#_48-sd-ex-analog-in-0-3" aria-label="Permalink to &quot;48. SD_EX_ANALOG_IN_0~3&quot;">​</a></h4><p>This variable represents the values (0~10V) of the 4 analog input ports on the expansion IO board.</p><h4 id="_49-sd-ex-analog-out-0-3" tabindex="-1">49. SD_EX_ANALOG_OUT_0~3 <a class="header-anchor" href="#_49-sd-ex-analog-out-0-3" aria-label="Permalink to &quot;49. SD_EX_ANALOG_OUT_0~3&quot;">​</a></h4><p>This variable represents the values (0~10V) of the 4 analog output ports on the expansion IO board.</p><h4 id="_50-sd-ex-digital-in-0-15" tabindex="-1">50. SD_EX_DIGITAL_IN_0~15 <a class="header-anchor" href="#_50-sd-ex-digital-in-0-15" aria-label="Permalink to &quot;50. SD_EX_DIGITAL_IN_0~15&quot;">​</a></h4><p>This variable represents the values (0 or 1) of the 16 digital input ports on the expansion IO board.</p><h4 id="_51-sd-ex-digital-out-0-15" tabindex="-1">51. SD_EX_DIGITAL_OUT_0~15 <a class="header-anchor" href="#_51-sd-ex-digital-out-0-15" aria-label="Permalink to &quot;51. SD_EX_DIGITAL_OUT_0~15&quot;">​</a></h4><p>This variable represents the values (0 or 1) of the 16 digital output ports on the expansion IO board.</p><h4 id="_52-sd-tfb-analog-in-0-1" tabindex="-1">52. SD_TFB_ANALOG_IN_0~1 <a class="header-anchor" href="#_52-sd-tfb-analog-in-0-1" aria-label="Permalink to &quot;52. SD_TFB_ANALOG_IN_0~1&quot;">​</a></h4><p>This variable represents the values (0~10V) of the 2 analog input ports on the tool flange board (TFB).</p><h4 id="_53-sd-tfb-digital-in-0-1" tabindex="-1">53. SD_TFB_DIGITAL_IN_0~1 <a class="header-anchor" href="#_53-sd-tfb-digital-in-0-1" aria-label="Permalink to &quot;53. SD_TFB_DIGITAL_IN_0~1&quot;">​</a></h4><p>This variable represents the values (0 or 1) of the 2 digital input ports on the tool flange board (TFB).</p><h4 id="_54-sd-tfb-digital-out-0-1" tabindex="-1">54. SD_TFB_DIGITAL_OUT_0~1 <a class="header-anchor" href="#_54-sd-tfb-digital-out-0-1" aria-label="Permalink to &quot;54. SD_TFB_DIGITAL_OUT_0~1&quot;">​</a></h4><p>This variable represents the values (0 or 1) of the 2 digital output ports on the tool flange board (TFB).</p><h4 id="_55-sd-tfb-voltage-out" tabindex="-1">55. SD_TFB_VOLTAGE_OUT <a class="header-anchor" href="#_55-sd-tfb-voltage-out" aria-label="Permalink to &quot;55. SD_TFB_VOLTAGE_OUT&quot;">​</a></h4><p>This variable represents the voltage output information of the tool flange board (TFB).</p><ul><li>Controls 3 output voltage values: 0V, 12V, 24V</li></ul><h4 id="_56-sd-hand-toktok" tabindex="-1">56. SD_HAND_TOKTOK <a class="header-anchor" href="#_56-sd-hand-toktok" aria-label="Permalink to &quot;56. SD_HAND_TOKTOK&quot;">​</a></h4><p>This variable indicates whether an external &quot;tapping&quot; action on the robot occurred.</p><h4 id="_57-sd-finish-at-event" tabindex="-1">57. SD_FINISH_AT_EVENT <a class="header-anchor" href="#_57-sd-finish-at-event" aria-label="Permalink to &quot;57. SD_FINISH_AT_EVENT&quot;">​</a></h4><p>This is the condition for finishing the movement (Finish At feature), indicating whether the robot has completed its movement.<br> When a new movement begins, this variable automatically resets to 0.</p><ul><li>0: When the movement is completed by reaching the target point.</li><li>1: When the movement is completed due to satisfying the FinishAt condition.</li></ul><h4 id="_58-sd-tcp-vel-ref" tabindex="-1">58. SD_TCP_VEL_REF <a class="header-anchor" href="#_58-sd-tcp-vel-ref" aria-label="Permalink to &quot;58. SD_TCP_VEL_REF&quot;">​</a></h4><p>This variable represents the commanded linear velocity of the current TCP. (mm/s)</p><h4 id="_59-sd-motion-time" tabindex="-1">59. SD_MOTION_TIME <a class="header-anchor" href="#_59-sd-motion-time" aria-label="Permalink to &quot;59. SD_MOTION_TIME&quot;">​</a></h4><p>This variable stores the elapsed time after the motion is executed. It resets when the next motion begins. (seconds)</p><h4 id="_60-sd-sock-is-open-0-4" tabindex="-1">60. SD_SOCK_IS_OPEN_0~4 <a class="header-anchor" href="#_60-sd-sock-is-open-0-4" aria-label="Permalink to &quot;60. SD_SOCK_IS_OPEN_0~4&quot;">​</a></h4><p>When the robot system is used as a client, this variable indicates whether the corresponding socket number (0 ~ 4) has been successfully opened (connected to the server).<br> When the robot system is used as a server, it indicates whether a client is connected to the server.</p><h4 id="_61-sd-sock-last-read-0-4" tabindex="-1">61. SD_SOCK_LAST_READ_0~4 <a class="header-anchor" href="#_61-sd-sock-last-read-0-4" aria-label="Permalink to &quot;61. SD_SOCK_LAST_READ_0~4&quot;">​</a></h4><p>This variable indicates the success or failure of the last read operation performed on the corresponding socket number (0~4).</p><h4 id="_62-sd-arm-power" tabindex="-1">62. SD_ARM_POWER <a class="header-anchor" href="#_62-sd-arm-power" aria-label="Permalink to &quot;62. SD_ARM_POWER&quot;">​</a></h4><p>This variable represents the power consumed by the robot arm.</p><h4 id="_63-sd-arm-power-amp" tabindex="-1">63. SD_ARM_POWER_AMP <a class="header-anchor" href="#_63-sd-arm-power-amp" aria-label="Permalink to &quot;63. SD_ARM_POWER_AMP&quot;">​</a></h4><p>This variable represents the current being used by the robot arm.</p><h4 id="_64-sd-is-tpu-connect" tabindex="-1">64. SD_IS_TPU_CONNECT <a class="header-anchor" href="#_64-sd-is-tpu-connect" aria-label="Permalink to &quot;64. SD_IS_TPU_CONNECT&quot;">​</a></h4><p>This variable indicates the connection status between the Teaching Pendant Unit (TPU) / tablet and the controller box.</p><h4 id="_65-sd-is-run-in-make" tabindex="-1">65. SD_IS_RUN_IN_MAKE <a class="header-anchor" href="#_65-sd-is-run-in-make" aria-label="Permalink to &quot;65. SD_IS_RUN_IN_MAKE&quot;">​</a></h4><p>This variable indicates whether the current program run was initiated from the &quot;Make&quot; window.</p><ul><li>1: Program run from the Make window.</li></ul><h4 id="_66-sd-is-run-in-play" tabindex="-1">66. SD_IS_RUN_IN_PLAY <a class="header-anchor" href="#_66-sd-is-run-in-play" aria-label="Permalink to &quot;66. SD_IS_RUN_IN_PLAY&quot;">​</a></h4><p>This variable indicates whether the current program run was initiated from the &quot;Play&quot; window.</p><ul><li>1: Program run from the Play window.</li></ul><h4 id="_67-sd-is-intended-stop" tabindex="-1">67. SD_IS_INTENDED_STOP <a class="header-anchor" href="#_67-sd-is-intended-stop" aria-label="Permalink to &quot;67. SD_IS_INTENDED_STOP&quot;">​</a></h4><p>This variable indicates whether the program stop was intentional.</p><h4 id="_68-sd-move-index" tabindex="-1">68. SD_MOVE_INDEX <a class="header-anchor" href="#_68-sd-move-index" aria-label="Permalink to &quot;68. SD_MOVE_INDEX&quot;">​</a></h4><p>This variable indicates the waypoint number being passed through when executing continuous movement commands such as MovePB, ITPL, or PRO. (Integer value)</p><h4 id="_69-sd-move-index-f" tabindex="-1">69. SD_MOVE_INDEX_F <a class="header-anchor" href="#_69-sd-move-index-f" aria-label="Permalink to &quot;69. SD_MOVE_INDEX_F&quot;">​</a></h4><p>This variable indicates the waypoint number being passed through during continuous movement commands such as MovePB, ITPL, or PRO, including decimal values for fractional progress.</p><h4 id="_70-sd-move-property" tabindex="-1">70. SD_MOVE_PROPERTY <a class="header-anchor" href="#_70-sd-move-property" aria-label="Permalink to &quot;70. SD_MOVE_PROPERTY&quot;">​</a></h4><p>This variable represents the current movement type being executed (e.g., J, L, PB, PRO, etc.).</p><h4 id="_71-sd-current-delta" tabindex="-1">71. SD_CURRENT_DELTA <a class="header-anchor" href="#_71-sd-current-delta" aria-label="Permalink to &quot;71. SD_CURRENT_DELTA&quot;">​</a></h4><p>This variable represents the magnitude of the difference between the predicted current and the actual current measured in each joint of the robot arm. (mA)</p><h4 id="_72-sd-force-travel-dis" tabindex="-1">72. SD_FORCE_TRAVEL_DIS <a class="header-anchor" href="#_72-sd-force-travel-dis" aria-label="Permalink to &quot;72. SD_FORCE_TRAVEL_DIS&quot;">​</a></h4><p>When using the force control feature, this variable indicates the magnitude of the trajectory deviation caused by the force control algorithm. (mm)</p><h4 id="_73-sd-emg-button-state" tabindex="-1">73. SD_EMG_BUTTON_STATE <a class="header-anchor" href="#_73-sd-emg-button-state" aria-label="Permalink to &quot;73. SD_EMG_BUTTON_STATE&quot;">​</a></h4><p>This variable shows the state of the emergency stop button.</p><h4 id="_74-sd-is-in-main" tabindex="-1">74. SD_IS_IN_MAIN <a class="header-anchor" href="#_74-sd-is-in-main" aria-label="Permalink to &quot;74. SD_IS_IN_MAIN&quot;">​</a></h4><p>This variable indicates whether the program is running the main program (= 1) or a subprogram (= 0).</p><h4 id="_75-sd-is-home" tabindex="-1">75. SD_IS_HOME <a class="header-anchor" href="#_75-sd-is-home" aria-label="Permalink to &quot;75. SD_IS_HOME&quot;">​</a></h4><p>This variable indicates whether the robot is in the home (BEGIN) position.</p><h4 id="_76-sd-is-begin" tabindex="-1">76. SD_IS_BEGIN <a class="header-anchor" href="#_76-sd-is-begin" aria-label="Permalink to &quot;76. SD_IS_BEGIN&quot;">​</a></h4><p>This variable also indicates whether the robot is in the home (BEGIN) position.</p><h4 id="_77-sd-id-number" tabindex="-1">77. SD_ID_NUMBER <a class="header-anchor" href="#_77-sd-id-number" aria-label="Permalink to &quot;77. SD_ID_NUMBER&quot;">​</a></h4><p>This variable represents the system ID, which can be changed in the setup.</p><h4 id="_78-sd-tf-lrf-distance" tabindex="-1">78. SD_TF_LRF_DISTANCE <a class="header-anchor" href="#_78-sd-tf-lrf-distance" aria-label="Permalink to &quot;78. SD_TF_LRF_DISTANCE&quot;">​</a></h4><p>This variable represents the distance measured by the TF laser range sensor. (mm)</p><h4 id="_79-sd-bit" tabindex="-1">79. SD_BIT_#_# <a class="header-anchor" href="#_79-sd-bit" aria-label="Permalink to &quot;79. SD_BIT\\_\\#\\_\\#&quot;">​</a></h4><p>SD_BIT_0_3<br> SD_BIT_4_7<br> SD_BIT_8_11<br> SD_BIT_12_15<br></p><p>This variable represents a number created by combining four digital input ports of the controller box in a binary combination.</p><ul><li>Combining four digital outputs: Can represent values from 0 to 15 (2⁴-1).</li></ul><h4 id="_80-sd-bit-0-7" tabindex="-1">80. SD_BIT_0_7 <a class="header-anchor" href="#_80-sd-bit-0-7" aria-label="Permalink to &quot;80. SD_BIT_0_7&quot;">​</a></h4><p>This variable represents a number created by combining eight digital input ports (ports 0 to 7) of the controller box in a binary combination.</p><ul><li>Combining eight digital outputs: Can represent values from 0 to 255 (2⁸-1).</li></ul><h4 id="_81-sd-bit-0-11" tabindex="-1">81. SD_BIT_0_11 <a class="header-anchor" href="#_81-sd-bit-0-11" aria-label="Permalink to &quot;81. SD_BIT_0_11&quot;">​</a></h4><p>This variable represents a number created by combining twelve digital input ports (ports 0 to 11) of the controller box in a binary combination.</p><ul><li>Combining twelve digital outputs: Can represent values from 0 to 4,095 (2¹²-1).</li></ul><h4 id="_82-sd-bit-0-15" tabindex="-1">82. SD_BIT_0_15 <a class="header-anchor" href="#_82-sd-bit-0-15" aria-label="Permalink to &quot;82. SD_BIT_0_15&quot;">​</a></h4><p>This variable represents a number created by combining sixteen digital input ports (ports 0 to 15) of the controller box in a binary combination.</p><ul><li>Combining sixteen digital outputs: Can represent values from 0 to 65,535 (2¹⁶-1).</li></ul><h4 id="_83-or-2fg7-state" tabindex="-1">83. OR_2FG7_STATE <a class="header-anchor" href="#_83-or-2fg7-state" aria-label="Permalink to &quot;83. OR_2FG7_STATE&quot;">​</a></h4><p>This variable represents the state of the OnRobot 2FG7 model gripper.</p><ul><li>1: Busy</li><li>2: Grip detected</li><li>3: Error (Not Calibrated)</li><li>4: Error (Linear sensor)</li></ul><h4 id="_84-or-2fg7-pos-ext" tabindex="-1">84. OR_2FG7_POS_EXT <a class="header-anchor" href="#_84-or-2fg7-pos-ext" aria-label="Permalink to &quot;84. OR_2FG7_POS_EXT&quot;">​</a></h4><p>This variable represents the current position of the gripper when gripping externally in the OnRobot 2FG7 model.</p><h4 id="_85-or-2fg7-pos-int" tabindex="-1">85. OR_2FG7_POS_INT <a class="header-anchor" href="#_85-or-2fg7-pos-int" aria-label="Permalink to &quot;85. OR_2FG7_POS_INT&quot;">​</a></h4><p>This variable represents the current position of the gripper when gripping internally in the OnRobot 2FG7 model.</p><h4 id="_86-or-2fg7-min-ext" tabindex="-1">86. OR_2FG7_MIN_EXT <a class="header-anchor" href="#_86-or-2fg7-min-ext" aria-label="Permalink to &quot;86. OR_2FG7_MIN_EXT&quot;">​</a></h4><p>This variable represents the minimum position value of the gripper when gripping externally in the OnRobot 2FG7 model.</p><h4 id="_87-or-2fg7-max-ext" tabindex="-1">87. OR_2FG7_MAX_EXT <a class="header-anchor" href="#_87-or-2fg7-max-ext" aria-label="Permalink to &quot;87. OR_2FG7_MAX_EXT&quot;">​</a></h4><p>This variable represents the maximum position value of the gripper when gripping externally in the OnRobot 2FG7 model.</p><h4 id="_88-or-2fg7-min-int" tabindex="-1">88. OR_2FG7_MIN_INT <a class="header-anchor" href="#_88-or-2fg7-min-int" aria-label="Permalink to &quot;88. OR_2FG7_MIN_INT&quot;">​</a></h4><p>This variable represents the minimum position value of the gripper when gripping internally in the OnRobot 2FG7 model.</p><h4 id="_89-or-2fg7-max-int" tabindex="-1">89. OR_2FG7_MAX_INT <a class="header-anchor" href="#_89-or-2fg7-max-int" aria-label="Permalink to &quot;89. OR_2FG7_MAX_INT&quot;">​</a></h4><p>This variable represents the maximum position value of the gripper when gripping internally in the OnRobot 2FG7 model.</p><h4 id="_90-or-rg-busy" tabindex="-1">90. OR_RG_BUSY <a class="header-anchor" href="#_90-or-rg-busy" aria-label="Permalink to &quot;90. OR_RG_BUSY&quot;">​</a></h4><p>This variable represents the operational state of the OnRobot RG model gripper.</p><ul><li>0: The gripper is not active and can receive the next command.</li><li>1: The gripper is currently active and cannot receive the next command.</li></ul><h4 id="_91-or-rg-grip" tabindex="-1">91. OR_RG_GRIP <a class="header-anchor" href="#_91-or-rg-grip" aria-label="Permalink to &quot;91. OR_RG_GRIP&quot;">​</a></h4><p>This variable indicates whether the gripper is currently gripping a product.</p><ul><li>0: Grip undetected.</li><li>1: Grip detected.</li></ul><h4 id="_92-or-rg-s1-pushed" tabindex="-1">92. OR_RG_S1_PUSHED <a class="header-anchor" href="#_92-or-rg-s1-pushed" aria-label="Permalink to &quot;92. OR_RG_S1_PUSHED&quot;">​</a></h4><p>This variable shows whether safety switch 1 on the OnRobot RG model is pressed.</p><ul><li>0: safety switch 1 is not pushed.</li><li>1: safety switch 1 is pushed.</li></ul><h4 id="_93-or-rg-s1-triggered" tabindex="-1">93. OR_RG_S1_TRIGGERED <a class="header-anchor" href="#_93-or-rg-s1-triggered" aria-label="Permalink to &quot;93. OR_RG_S1_TRIGGERED&quot;">​</a></h4><p>This variable indicates whether safety circuit 1 on the OnRobot RG model is activated.</p><ul><li>0: safety circuit 1 is not activated.</li><li>1: safety circuit 1 is activated.</li></ul><h4 id="_94-or-rg-s2-pushed" tabindex="-1">94. OR_RG_S2_PUSHED <a class="header-anchor" href="#_94-or-rg-s2-pushed" aria-label="Permalink to &quot;94. OR_RG_S2_PUSHED&quot;">​</a></h4><p>This variable shows whether safety switch 2 on the OnRobot RG model is pressed.</p><ul><li>0: safety switch 2 is not pushed.</li><li>1: safety switch 2 is pushed.</li></ul><h4 id="_95-or-rg-s2-triggered" tabindex="-1">95. OR_RG_S2_TRIGGERED <a class="header-anchor" href="#_95-or-rg-s2-triggered" aria-label="Permalink to &quot;95. OR_RG_S2_TRIGGERED&quot;">​</a></h4><p>This variable indicates whether safety circuit 2 on the OnRobot RG model is activated.</p><ul><li>0: safety circuit 2 is not activated.</li><li>1: safety circuit 2 is activated.</li></ul><h4 id="_96-or-rg-error" tabindex="-1">96. OR_RG_ERROR <a class="header-anchor" href="#_96-or-rg-error" aria-label="Permalink to &quot;96. OR_RG_ERROR&quot;">​</a></h4><p>This variable shows whether any safety-related error has occurred in the OnRobot RG model.</p><h4 id="_97-or-rg-width" tabindex="-1">97. OR_RG_WIDTH <a class="header-anchor" href="#_97-or-rg-width" aria-label="Permalink to &quot;97. OR_RG_WIDTH&quot;">​</a></h4><p>This variable represents the distance between the gripper fingers in the OnRobot RG model.</p><h4 id="_98-or-3fg-min-d" tabindex="-1">98. OR_3FG_MIN_D <a class="header-anchor" href="#_98-or-3fg-min-d" aria-label="Permalink to &quot;98. OR_3FG_MIN_D&quot;">​</a></h4><p>This variable indicates the minimum achievable diameter based on the position, length, and diameter of the fingers in the OnRobot 3FG model.</p><h4 id="_99-or-3fg-max-d" tabindex="-1">99. OR_3FG_MAX_D <a class="header-anchor" href="#_99-or-3fg-max-d" aria-label="Permalink to &quot;99. OR_3FG_MAX_D&quot;">​</a></h4><p>This variable indicates the maximum achievable diameter based on the position, length, and diameter of the fingers in the OnRobot 3FG model.</p><h4 id="_100-or-3fg-raw-d" tabindex="-1">100. OR_3FG_RAW_D <a class="header-anchor" href="#_100-or-3fg-raw-d" aria-label="Permalink to &quot;100. OR_3FG_RAW_D&quot;">​</a></h4><p>This variable represents the diameter size of the fingers in the OnRobot 3FG model.</p><h4 id="_101-or-3fg-real-d" tabindex="-1">101. OR_3FG_REAL_D <a class="header-anchor" href="#_101-or-3fg-real-d" aria-label="Permalink to &quot;101. OR_3FG_REAL_D&quot;">​</a></h4><p>This variable represents the diameter size, taking into account the offset of the finger thickness in the OnRobot 3FG model.</p><h4 id="_102-or-3fg-force" tabindex="-1">102. OR_3FG_FORCE <a class="header-anchor" href="#_102-or-3fg-force" aria-label="Permalink to &quot;102. OR_3FG_FORCE&quot;">​</a></h4><p>This variable shows the current force value being applied by the OnRobot 3FG model.</p><h4 id="_103-or-3fg-busy" tabindex="-1">103. OR_3FG_BUSY <a class="header-anchor" href="#_103-or-3fg-busy" aria-label="Permalink to &quot;103. OR_3FG_BUSY&quot;">​</a></h4><p>This variable indicates whether the OnRobot 3FG model gripper is currently operating.</p><h4 id="_104-or-3fg-grip" tabindex="-1">104. OR_3FG_GRIP <a class="header-anchor" href="#_104-or-3fg-grip" aria-label="Permalink to &quot;104. OR_3FG_GRIP&quot;">​</a></h4><p>This variable indicates whether the gripper in the OnRobot 3FG model has gripped an object.</p><h4 id="_105-or-3fg-force-grip" tabindex="-1">105. OR_3FG_FORCE_GRIP <a class="header-anchor" href="#_105-or-3fg-force-grip" aria-label="Permalink to &quot;105. OR_3FG_FORCE_GRIP&quot;">​</a></h4><p>This variable shows whether the OnRobot 3FG model gripper is gripping an object using force control.</p><h4 id="_106-or-3fg-calib" tabindex="-1">106. OR_3FG_CALIB <a class="header-anchor" href="#_106-or-3fg-calib" aria-label="Permalink to &quot;106. OR_3FG_CALIB&quot;">​</a></h4><p>This variable shows the calibration status of the OnRobot 3FG model gripper.</p><h4 id="_107-or-sd-status" tabindex="-1">107. OR_SD_STATUS <a class="header-anchor" href="#_107-or-sd-status" aria-label="Permalink to &quot;107. OR_SD_STATUS&quot;">​</a></h4><p>This variable indicates the status of the OnRobot Sander model.</p><h4 id="_108-or-sd-warning" tabindex="-1">108. OR_SD_WARNING <a class="header-anchor" href="#_108-or-sd-warning" aria-label="Permalink to &quot;108. OR_SD_WARNING&quot;">​</a></h4><p>This variable represents the state of the warning flag for the OnRobot Sander model.<br> It is composed of bit combinations, with the numbers representing the bit combination offsets.</p><ul><li>0: RPM deviation</li><li>1: Motor voltage</li><li>2: Motor current</li><li>3: Temperature</li><li>4: Vibration</li><li>5: 30V level</li><li>6: 24V level</li><li>7: 12V level</li><li>8: 5V level</li><li>9: Motor ramp error</li><li>10: Motor RPM range error</li><li>11: Motor missed zero crossing error</li><li>12: Motor RPM change error</li><li>13: Motor stopped due to communication error</li></ul><h4 id="_109-or-sd-rpm" tabindex="-1">109. OR_SD_RPM <a class="header-anchor" href="#_109-or-sd-rpm" aria-label="Permalink to &quot;109. OR_SD_RPM&quot;">​</a></h4><p>This variable shows the current rotational speed in RPM (Revolutions Per Minute) for the OnRobot Sander model.</p><h4 id="_110-or-sd-rpm-dev" tabindex="-1">110. OR_SD_RPM_DEV <a class="header-anchor" href="#_110-or-sd-rpm-dev" aria-label="Permalink to &quot;110. OR_SD_RPM_DEV&quot;">​</a></h4><p>This variable indicates the amount of RPM deviation during operation in the OnRobot Sander model.</p><h4 id="_111-or-sd-vibration" tabindex="-1">111. OR_SD_VIBRATION <a class="header-anchor" href="#_111-or-sd-vibration" aria-label="Permalink to &quot;111. OR_SD_VIBRATION&quot;">​</a></h4><p>This variable measures the vibration magnitude in G-force units for the OnRobot Sander model.</p><h4 id="_112-or-sd-error" tabindex="-1">112. OR_SD_ERROR <a class="header-anchor" href="#_112-or-sd-error" aria-label="Permalink to &quot;112. OR_SD_ERROR&quot;">​</a></h4><p>This variable represents the error that caused the motor to stop in the OnRobot Sander model.<br> It is reset by a new start command and is composed of bit combinations, with the numbers representing bit combination offsets.</p><ul><li>0: 30V error</li><li>1: 24V error</li><li>2: 12V error</li><li>3: 5V error</li><li>4: Current error</li><li>5: Vibration error</li><li>6: Temperature error</li><li>7: Modbus timeout error</li><li>8: Motor ramp error</li><li>9: Motor RPM range error</li><li>10: Motor missed zero cross error</li><li>11: Motor RPM change error</li><li>12: Firmware update started during motor run</li></ul><h4 id="_113-or-sd-rpm-tar" tabindex="-1">113. OR_SD_RPM_TAR <a class="header-anchor" href="#_113-or-sd-rpm-tar" aria-label="Permalink to &quot;113. OR_SD_RPM_TAR&quot;">​</a></h4><p>This variable shows the target RPM value for the OnRobot Sander model.</p><h4 id="_114-or-sd-motor-stopped" tabindex="-1">114. OR_SD_MOTOR_STOPPED <a class="header-anchor" href="#_114-or-sd-motor-stopped" aria-label="Permalink to &quot;114. OR_SD_MOTOR_STOPPED&quot;">​</a></h4><p>This flag indicates whether the motor in the OnRobot Sander model has stopped.</p><h4 id="_115-or-sd-motor-running" tabindex="-1">115. OR_SD_MOTOR_RUNNING <a class="header-anchor" href="#_115-or-sd-motor-running" aria-label="Permalink to &quot;115. OR_SD_MOTOR_RUNNING&quot;">​</a></h4><p>This flag indicates whether the motor in the OnRobot Sander model is currently running.</p><h4 id="_116-or-sd-ramp-up" tabindex="-1">116. OR_SD_RAMP_UP <a class="header-anchor" href="#_116-or-sd-ramp-up" aria-label="Permalink to &quot;116. OR_SD_RAMP_UP&quot;">​</a></h4><p>This variable indicates whether the motor is accelerating for the OnRobot Sander model.</p><h4 id="_117-or-sd-ramp-dw" tabindex="-1">117. OR_SD_RAMP_DW <a class="header-anchor" href="#_117-or-sd-ramp-dw" aria-label="Permalink to &quot;117. OR_SD_RAMP_DW&quot;">​</a></h4><p>This variable indicates whether the motor is decelerating for the OnRobot Sander model.</p><h4 id="_118-or-sd-button" tabindex="-1">118. OR_SD_BUTTON <a class="header-anchor" href="#_118-or-sd-button" aria-label="Permalink to &quot;118. OR_SD_BUTTON&quot;">​</a></h4><p>This variable shows whether the button on the side of the Sander is pressed for the OnRobot Sander model.</p><h4 id="_119-or-vg-a" tabindex="-1">119. OR_VG_A <a class="header-anchor" href="#_119-or-vg-a" aria-label="Permalink to &quot;119. OR_VG_A&quot;">​</a></h4><p>This variable represents the pressure value of channel A for the OnRobot VG10/VGC10 model.</p><h4 id="_120-or-vg-b" tabindex="-1">120. OR_VG_B <a class="header-anchor" href="#_120-or-vg-b" aria-label="Permalink to &quot;120. OR_VG_B&quot;">​</a></h4><p>This variable represents the pressure value of channel B for the OnRobot VG10/VGC10 model.</p><h4 id="_121-or-vgp20-a" tabindex="-1">121. OR_VGP20_A <a class="header-anchor" href="#_121-or-vgp20-a" aria-label="Permalink to &quot;121. OR_VGP20_A&quot;">​</a></h4><p>This variable represents the pressure value of channel A for the OnRobot VGP20 model.</p><h4 id="_122-or-vgp20-b" tabindex="-1">122. OR_VGP20_B <a class="header-anchor" href="#_122-or-vgp20-b" aria-label="Permalink to &quot;122. OR_VGP20_B&quot;">​</a></h4><p>This variable represents the pressure value of channel B for the OnRobot VGP20 model.</p><h4 id="_123-or-vgp20-c" tabindex="-1">123. OR_VGP20_C <a class="header-anchor" href="#_123-or-vgp20-c" aria-label="Permalink to &quot;123. OR_VGP20_C&quot;">​</a></h4><p>This variable represents the pressure value of channel C for the OnRobot VGP20 model.</p><h4 id="_124-or-vgp20-d" tabindex="-1">124. OR_VGP20_D <a class="header-anchor" href="#_124-or-vgp20-d" aria-label="Permalink to &quot;124. OR_VGP20_D&quot;">​</a></h4><p>This variable represents the pressure value of channel D for the OnRobot VGP20 model.</p><h4 id="_125-or-vgp20-a-grip" tabindex="-1">125. OR_VGP20_A_GRIP <a class="header-anchor" href="#_125-or-vgp20-a-grip" aria-label="Permalink to &quot;125. OR_VGP20_A_GRIP&quot;">​</a></h4><p>This variable indicates the grip state of channel A for the OnRobot VGP20 model.</p><h4 id="_126-or-vgp20-a-release" tabindex="-1">126. OR_VGP20_A_RELEASE <a class="header-anchor" href="#_126-or-vgp20-a-release" aria-label="Permalink to &quot;126. OR_VGP20_A_RELEASE&quot;">​</a></h4><p>This variable indicates the release state of channel A for the OnRobot VGP20 model.</p><h4 id="_127-or-vgp20-b-grip" tabindex="-1">127. OR_VGP20_B_GRIP <a class="header-anchor" href="#_127-or-vgp20-b-grip" aria-label="Permalink to &quot;127. OR_VGP20_B_GRIP&quot;">​</a></h4><p>This variable indicates the grip state of channel B for the OnRobot VGP20 model.</p><h4 id="_128-or-vgp20-b-release" tabindex="-1">128. OR_VGP20_B_RELEASE <a class="header-anchor" href="#_128-or-vgp20-b-release" aria-label="Permalink to &quot;128. OR_VGP20_B_RELEASE&quot;">​</a></h4><p>This variable indicates the release state of channel B for the OnRobot VGP20 model.</p><h4 id="_129-or-vgp20-c-grip" tabindex="-1">129. OR_VGP20_C_GRIP <a class="header-anchor" href="#_129-or-vgp20-c-grip" aria-label="Permalink to &quot;129. OR_VGP20_C_GRIP&quot;">​</a></h4><p>This variable indicates the grip state of channel C for the OnRobot VGP20 model.</p><h4 id="_130-or-vgp20-c-release" tabindex="-1">130. OR_VGP20_C_RELEASE <a class="header-anchor" href="#_130-or-vgp20-c-release" aria-label="Permalink to &quot;130. OR_VGP20_C_RELEASE&quot;">​</a></h4><p>This variable indicates the release state of channel C for the OnRobot VGP20 model.</p><h4 id="_131-or-vgp20-d-grip" tabindex="-1">131. OR_VGP20_D_GRIP <a class="header-anchor" href="#_131-or-vgp20-d-grip" aria-label="Permalink to &quot;131. OR_VGP20_D_GRIP&quot;">​</a></h4><p>This variable indicates the grip state of channel D for the OnRobot VGP20 model.</p><h4 id="_132-or-vgp20-d-release" tabindex="-1">132. OR_VGP20_D_RELEASE <a class="header-anchor" href="#_132-or-vgp20-d-release" aria-label="Permalink to &quot;132. OR_VGP20_D_RELEASE&quot;">​</a></h4><p>This variable indicates the release state of channel D for the OnRobot VGP20 model.</p><h4 id="_133-or-vgp20-busy" tabindex="-1">133. OR_VGP20_BUSY <a class="header-anchor" href="#_133-or-vgp20-busy" aria-label="Permalink to &quot;133. OR_VGP20_BUSY&quot;">​</a></h4><p>This variable indicates whether the gripper is in operation for the OnRobot VGP20 model.</p><h4 id="_134-or-vgp20-error" tabindex="-1">134. OR_VGP20_ERROR <a class="header-anchor" href="#_134-or-vgp20-error" aria-label="Permalink to &quot;134. OR_VGP20_ERROR&quot;">​</a></h4><p>This variable represents the error state of the gripper for the OnRobot VGP20 model.</p><h4 id="_135-or-mg10-status" tabindex="-1">135. OR_MG10_STATUS <a class="header-anchor" href="#_135-or-mg10-status" aria-label="Permalink to &quot;135. OR_MG10_STATUS&quot;">​</a></h4><p>This variable indicates the current status of the gripper for the OnRobot MG10 model. It is a bit combination, and the numbers below refer to the bit combination offsets.</p><ul><li>0: Part gripped</li><li>1: Near part</li><li>2: Busy</li><li>3: Magnet strength not reached</li><li>4: Smart grip available</li><li>5: Smart grip failed</li><li>6: Part dropped</li><li>7: Internal temperature warning</li></ul><h4 id="_136-or-mg10-error" tabindex="-1">136. OR_MG10_ERROR <a class="header-anchor" href="#_136-or-mg10-error" aria-label="Permalink to &quot;136. OR_MG10_ERROR&quot;">​</a></h4><p>This variable represents the current error state of the gripper for the OnRobot MG10 model. It is a bit combination, and the numbers below refer to the bit combination offsets.</p><ul><li>0: Over-heating</li><li>1: Sensor target mismatch</li><li>2: No motor calibration</li><li>3: No magnet calibration</li><li>4: No hall calibration</li><li>5: Over current</li><li>6: Position error</li></ul><h4 id="_137-or-mg10-strength" tabindex="-1">137. OR_MG10_STRENGTH <a class="header-anchor" href="#_137-or-mg10-strength" aria-label="Permalink to &quot;137. OR_MG10_STRENGTH&quot;">​</a></h4><p>This variable represents the magnet strength of the current gripper for the OnRobot MG10 model, expressed as a percentage.</p><h4 id="_138-or-sg-width" tabindex="-1">138. OR_SG_WIDTH <a class="header-anchor" href="#_138-or-sg-width" aria-label="Permalink to &quot;138. OR_SG_WIDTH&quot;">​</a></h4><p>This variable represents the width of the current gripper for the OnRobot Soft-gripper model.</p><h4 id="_139-or-sg-max-width" tabindex="-1">139. OR_SG_MAX_WIDTH <a class="header-anchor" href="#_139-or-sg-max-width" aria-label="Permalink to &quot;139. OR_SG_MAX_WIDTH&quot;">​</a></h4><p>This variable represents the maximum width of the current gripper for the OnRobot Soft-gripper model.</p><h4 id="_140-or-sg-min-width" tabindex="-1">140. OR_SG_MIN_WIDTH <a class="header-anchor" href="#_140-or-sg-min-width" aria-label="Permalink to &quot;140. OR_SG_MIN_WIDTH&quot;">​</a></h4><p>This variable represents the minimum width of the current gripper for the OnRobot Soft-gripper model.</p><h4 id="_141-or-sg-status" tabindex="-1">141. OR_SG_STATUS <a class="header-anchor" href="#_141-or-sg-status" aria-label="Permalink to &quot;141. OR_SG_STATUS&quot;">​</a></h4><p>This variable indicates the current status of the gripper for the OnRobot MG10 model. It is a bit combination variable.</p><ul><li>0: Busy</li><li>1: Initialized</li><li>4-6: Error</li></ul><h4 id="_142-or-eye-pos" tabindex="-1">142. OR_EYE_POS <a class="header-anchor" href="#_142-or-eye-pos" aria-label="Permalink to &quot;142. OR_EYE_POS&quot;">​</a></h4><p>This variable stores the object position value received from the OnRobot Eye vision camera.<br> (Type: Point)</p><h4 id="_143-or-eye-error" tabindex="-1">143. OR_EYE_ERROR <a class="header-anchor" href="#_143-or-eye-error" aria-label="Permalink to &quot;143. OR_EYE_ERROR&quot;">​</a></h4><p>This variable represents the error state of the vision system for the OnRobot Eye model.</p><h4 id="_144-or-eye-count" tabindex="-1">144. OR_EYE_COUNT <a class="header-anchor" href="#_144-or-eye-count" aria-label="Permalink to &quot;144. OR_EYE_COUNT&quot;">​</a></h4><p>This variable indicates the number of objects found by the vision system for the OnRobot Eye model.</p><h4 id="_145-or-eye-inspect-result" tabindex="-1">145. OR_EYE_INSPECT_RESULT <a class="header-anchor" href="#_145-or-eye-inspect-result" aria-label="Permalink to &quot;145. OR_EYE_INSPECT_RESULT&quot;">​</a></h4><p>This variable represents the inspection results of the vision system for the OnRobot Eye model.</p><h4 id="_146-or-eye-inspect-match" tabindex="-1">146. OR_EYE_INSPECT_MATCH <a class="header-anchor" href="#_146-or-eye-inspect-match" aria-label="Permalink to &quot;146. OR_EYE_INSPECT_MATCH&quot;">​</a></h4><p>This variable indicates the percentage match between the object found by the vision system and the actual object data registered in the vision system for the OnRobot Eye model.</p><h4 id="_147-or-eye-x" tabindex="-1">147. OR_EYE_X <a class="header-anchor" href="#_147-or-eye-x" aria-label="Permalink to &quot;147. OR_EYE_X&quot;">​</a></h4><p>This variable represents the X-axis data value of the object found by the vision system for the OnRobot Eye model.<br> (Unit: mm)</p><h4 id="_148-or-eye-y" tabindex="-1">148. OR_EYE_Y <a class="header-anchor" href="#_148-or-eye-y" aria-label="Permalink to &quot;148. OR_EYE_Y&quot;">​</a></h4><p>This variable represents the Y-axis data value of the object found by the vision system for the OnRobot Eye model.<br> (Unit: mm)</p><h4 id="_149-or-eye-z" tabindex="-1">149. OR_EYE_Z <a class="header-anchor" href="#_149-or-eye-z" aria-label="Permalink to &quot;149. OR_EYE_Z&quot;">​</a></h4><p>This variable represents the Z-axis data value of the object found by the vision system for the OnRobot Eye model.<br> (Unit: mm)</p><h4 id="_150-or-eye-rx" tabindex="-1">150. OR_EYE_RX <a class="header-anchor" href="#_150-or-eye-rx" aria-label="Permalink to &quot;150. OR_EYE_RX&quot;">​</a></h4><p>This variable represents the RX-axis data value of the object found by the vision system for the OnRobot Eye model.<br> (Unit: degree)</p><h4 id="_151-or-eye-ry" tabindex="-1">151. OR_EYE_RY <a class="header-anchor" href="#_151-or-eye-ry" aria-label="Permalink to &quot;151. OR_EYE_RY&quot;">​</a></h4><p>This variable represents the RY-axis data value of the object found by the vision system for the OnRobot Eye model.<br> (Unit: degree)</p><h4 id="_152-or-eye-rz" tabindex="-1">152. OR_EYE_RZ <a class="header-anchor" href="#_152-or-eye-rz" aria-label="Permalink to &quot;152. OR_EYE_RZ&quot;">​</a></h4><p>This variable represents the RZ-axis data value of the object found by the vision system for the OnRobot Eye model.<br> (Unit: degree)</p><h4 id="_153-jrt-encoder" tabindex="-1">153. JRT_ENCODER <a class="header-anchor" href="#_153-jrt-encoder" aria-label="Permalink to &quot;153. JRT_ENCODER&quot;">​</a></h4><p>This variable represents the encoder value of the current gripper for all models of JuGwang Robotec, expressed in pulse units.</p><h4 id="_154-jrt-jegb" tabindex="-1">154. JRT_JEGB <a class="header-anchor" href="#_154-jrt-jegb" aria-label="Permalink to &quot;154. JRT_JEGB&quot;">​</a></h4><p>This variable represents the position value of the current gripper for the JuGwang Robotec JEGB model, expressed as a percentage.</p><h4 id="_155-jrt-jegg" tabindex="-1">155. JRT_JEGG <a class="header-anchor" href="#_155-jrt-jegg" aria-label="Permalink to &quot;155. JRT_JEGG&quot;">​</a></h4><p>This variable represents the position value of the current gripper for the JuGwang Robotec JEGG model, expressed as a percentage.</p><h4 id="_156-pickit-pos" tabindex="-1">156. PICKIT_POS <a class="header-anchor" href="#_156-pickit-pos" aria-label="Permalink to &quot;156. PICKIT_POS&quot;">​</a></h4><p>This variable stores the object position value received from the PICK-IT vision camera.<br> (Type: Point)</p><h4 id="_157-rc-pickit-no-command" tabindex="-1">157. RC_PICKIT_NO_COMMAND <a class="header-anchor" href="#_157-rc-pickit-no-command" aria-label="Permalink to &quot;157. RC_PICKIT_NO_COMMAND&quot;">​</a></h4><p>This variable sends the position value of the current robot flange to the PICK-IT vision system.<br> It is used to check the connection status of the robot and update the 3D view on the web interface.</p><h4 id="_158-rc-pickit-check-mode" tabindex="-1">158. RC_PICKIT_CHECK_MODE <a class="header-anchor" href="#_158-rc-pickit-check-mode" aria-label="Permalink to &quot;158. RC_PICKIT_CHECK_MODE&quot;">​</a></h4><p>This variable indicates the mode of the vision system for the PICK-IT command Robot&gt;PickIt.</p><h4 id="_159-rc-pickit-capture-image" tabindex="-1">159. RC_PICKIT_CAPTURE_IMAGE <a class="header-anchor" href="#_159-rc-pickit-capture-image" aria-label="Permalink to &quot;159. RC_PICKIT_CAPTURE_IMAGE&quot;">​</a></h4><p>Using this variable will capture the current camera image for the PICK-IT command Robot&gt;PickIt.</p><h4 id="_160-rc-pickit-process-image" tabindex="-1">160. RC_PICKIT_PROCESS_IMAGE <a class="header-anchor" href="#_160-rc-pickit-process-image" aria-label="Permalink to &quot;160. RC_PICKIT_PROCESS_IMAGE&quot;">​</a></h4><p>This variable triggers object detection using the camera image captured via <strong>RC_PICKIT_CAPTURE_IMAGE</strong> for the PICK-IT command Robot&gt;PickIt.</p><h4 id="_161-rc-pickit-look-for-objects" tabindex="-1">161. RC_PICKIT_LOOK_FOR_OBJECTS <a class="header-anchor" href="#_161-rc-pickit-look-for-objects" aria-label="Permalink to &quot;161. RC_PICKIT_LOOK_FOR_OBJECTS&quot;">​</a></h4><p>This command requests the current screen to look for objects in the PICK-IT command Robot&gt;PickIt.</p><h4 id="_162-rc-pickit-look-for-objects-with-retries" tabindex="-1">162. RC_PICKIT_LOOK_FOR_OBJECTS_WITH_RETRIES <a class="header-anchor" href="#_162-rc-pickit-look-for-objects-with-retries" aria-label="Permalink to &quot;162. RC_PICKIT_LOOK_FOR_OBJECTS_WITH_RETRIES&quot;">​</a></h4><p>This command requests the current screen to look for objects in the PICK-IT command Robot&gt;PickIt.<br> It is similar to the RC_PICKIT_LOOK_FOR_OBJECTS command but retries after a certain time if no object is found.</p><h4 id="_163-rc-pickit-next-object" tabindex="-1">163. RC_PICKIT_NEXT_OBJECT <a class="header-anchor" href="#_163-rc-pickit-next-object" aria-label="Permalink to &quot;163. RC_PICKIT_NEXT_OBJECT&quot;">​</a></h4><p>This command requests to return the next detected object to the object table in the PICK-IT command Robot&gt;PickIt.<br> It is used when multiple objects are detected during a single object search execution.</p><h4 id="_164-rc-pickit-get-pick-point-data" tabindex="-1">164. RC_PICKIT_GET_PICK_POINT_DATA <a class="header-anchor" href="#_164-rc-pickit-get-pick-point-data" aria-label="Permalink to &quot;164. RC_PICKIT_GET_PICK_POINT_DATA&quot;">​</a></h4><p>This command requests the pick point ID and offset values of the last requested object in the PICK-IT command Robot&gt;PickIt.<br> Through this command, the robot can obtain flexible and diverse pick points.</p><h4 id="_165-rc-pickit-configure" tabindex="-1">165. RC_PICKIT_CONFIGURE <a class="header-anchor" href="#_165-rc-pickit-configure" aria-label="Permalink to &quot;165. RC_PICKIT_CONFIGURE&quot;">​</a></h4><p>This command is used to load specific setup information and product configuration information in the PICK-IT command Robot&gt;PickIt.</p><h4 id="_166-rc-pickit-set-cylinder-dim" tabindex="-1">166. RC_PICKIT_SET_CYLINDER_DIM <a class="header-anchor" href="#_166-rc-pickit-set-cylinder-dim" aria-label="Permalink to &quot;166. RC_PICKIT_SET_CYLINDER_DIM&quot;">​</a></h4><p>This command is used to request cylinder dimensions when using the teach cylinder model in the PICK-IT command Robot&gt;PickIt.</p><h4 id="_167-rc-save-active-product" tabindex="-1">167. RC_SAVE_ACTIVE_PRODUCT <a class="header-anchor" href="#_167-rc-save-active-product" aria-label="Permalink to &quot;167. RC_SAVE_ACTIVE_PRODUCT&quot;">​</a></h4><p>This command is used to save the currently loaded product data in the PICK-IT command Robot&gt;PickIt.</p><h4 id="_168-rc-save-active-setup" tabindex="-1">168. RC_SAVE_ACTIVE_SETUP <a class="header-anchor" href="#_168-rc-save-active-setup" aria-label="Permalink to &quot;168. RC_SAVE_ACTIVE_SETUP&quot;">​</a></h4><p>This command is used to save the currently loaded setup data in the PICK-IT command Robot&gt;PickIt.</p><h4 id="_169-rc-save-build-background" tabindex="-1">169. RC_SAVE_BUILD_BACKGROUND <a class="header-anchor" href="#_169-rc-save-build-background" aria-label="Permalink to &quot;169. RC_SAVE_BUILD_BACKGROUND&quot;">​</a></h4><p>This command requests to capture the current scene as a background for background removal in the PICK-IT command Robot&gt;PickIt.</p><h4 id="_170-rc-pickit-find-calib-plate" tabindex="-1">170. RC_PICKIT_FIND_CALIB_PLATE <a class="header-anchor" href="#_170-rc-pickit-find-calib-plate" aria-label="Permalink to &quot;170. RC_PICKIT_FIND_CALIB_PLATE&quot;">​</a></h4><p>This is a trigger command to localize the calibration plate in the PICK-IT command Robot&gt;PickIt.</p><h4 id="_171-rc-pickit-save-scene" tabindex="-1">171. RC_PICKIT_SAVE_SCENE <a class="header-anchor" href="#_171-rc-pickit-save-scene" aria-label="Permalink to &quot;171. RC_PICKIT_SAVE_SCENE&quot;">​</a></h4><p>This command is used to save the current scene in the PICK-IT command Robot&gt;PickIt.</p><h4 id="_172-pickit-status" tabindex="-1">172. PICKIT_STATUS <a class="header-anchor" href="#_172-pickit-status" aria-label="Permalink to &quot;172. PICKIT_STATUS&quot;">​</a></h4><p>This variable indicates the status of the vision system for PICK-IT.</p><h4 id="_173-pickit-version" tabindex="-1">173. PICKIT_VERSION <a class="header-anchor" href="#_173-pickit-version" aria-label="Permalink to &quot;173. PICKIT_VERSION&quot;">​</a></h4><p>This variable indicates the version of the PICK-IT protocol being used. (=11)</p><h4 id="_174-pickit-robottype" tabindex="-1">174. PICKIT_ROBOTTYPE <a class="header-anchor" href="#_174-pickit-robottype" aria-label="Permalink to &quot;174. PICKIT_ROBOTTYPE&quot;">​</a></h4><p>This variable indicates the type of robot connected to the vision system for PICK-IT. (=Type 5)</p><h4 id="_175-pickit-robot-mode" tabindex="-1">175. PICKIT_ROBOT_MODE <a class="header-anchor" href="#_175-pickit-robot-mode" aria-label="Permalink to &quot;175. PICKIT_ROBOT_MODE&quot;">​</a></h4><p>This variable indicates that the vision system is in robot mode for the PICK-IT command return value.<br> (Constant value: 0)</p><h4 id="_176-pickit-idle-mode" tabindex="-1">176. PICKIT_IDLE_MODE <a class="header-anchor" href="#_176-pickit-idle-mode" aria-label="Permalink to &quot;176. PICKIT_IDLE_MODE&quot;">​</a></h4><p>This variable indicates that the vision system is in idle mode for the PICK-IT return value.<br> (Constant value: 1)</p><h4 id="_177-pickit-object-found" tabindex="-1">177. PICKIT_OBJECT_FOUND <a class="header-anchor" href="#_177-pickit-object-found" aria-label="Permalink to &quot;177. PICKIT_OBJECT_FOUND&quot;">​</a></h4><p>This variable indicates that the vision system has detected one or more objects for the PICK-IT return value.<br> (Constant value: 20)</p><h4 id="_178-pickit-no-objects" tabindex="-1">178. PICKIT_NO_OBJECTS <a class="header-anchor" href="#_178-pickit-no-objects" aria-label="Permalink to &quot;178. PICKIT_NO_OBJECTS&quot;">​</a></h4><p>This variable indicates that the vision system has not detected any objects for the PICK-IT return value.<br> (Constant value: 21)</p><h4 id="_179-pickit-image-captured" tabindex="-1">179. PICKIT_IMAGE_CAPTURED <a class="header-anchor" href="#_179-pickit-image-captured" aria-label="Permalink to &quot;179. PICKIT_IMAGE_CAPTURED&quot;">​</a></h4><p>This variable indicates that the vision system has captured a camera image for the PICK-IT return value.<br> (Constant value: 26)</p><h4 id="_180-pickit-no-image-captured" tabindex="-1">180. PICKIT_NO_IMAGE_CAPTURED <a class="header-anchor" href="#_180-pickit-no-image-captured" aria-label="Permalink to &quot;180. PICKIT_NO_IMAGE_CAPTURED&quot;">​</a></h4><p>This variable indicates that the vision system has not captured any camera image for the PICK-IT return value.<br> (Constant value: 22)</p><h4 id="_181-pickit-empty-roi" tabindex="-1">181. PICKIT_EMPTY_ROI <a class="header-anchor" href="#_181-pickit-empty-roi" aria-label="Permalink to &quot;181. PICKIT_EMPTY_ROI&quot;">​</a></h4><p>This variable indicates that the vision system has detected an empty ROI (Region of Interest) for the PICK-IT return value.<br> (Constant value: 23)</p><h4 id="_182-pickit-get-pick-point-data-ok" tabindex="-1">182. PICKIT_GET_PICK_POINT_DATA_OK <a class="header-anchor" href="#_182-pickit-get-pick-point-data-ok" aria-label="Permalink to &quot;182. PICKIT_GET_PICK_POINT_DATA_OK&quot;">​</a></h4><p>This variable indicates that the vision system has successfully retrieved pick point data for the PICK-IT return value.<br> (Constant value: 70)</p><h4 id="_183-pickit-get-pick-point-data-failed" tabindex="-1">183. PICKIT_GET_PICK_POINT_DATA_FAILED <a class="header-anchor" href="#_183-pickit-get-pick-point-data-failed" aria-label="Permalink to &quot;183. PICKIT_GET_PICK_POINT_DATA_FAILED&quot;">​</a></h4><p>This variable indicates that the vision system has failed to retrieve the selected pick point data for the PICK-IT return value.<br> (Constant value: 71)</p><h4 id="_184-pickit-config-ok" tabindex="-1">184. PICKIT_CONFIG_OK <a class="header-anchor" href="#_184-pickit-config-ok" aria-label="Permalink to &quot;184. PICKIT_CONFIG_OK&quot;">​</a></h4><p>This variable indicates that the specified configuration has been successfully loaded for the PICK-IT return value.<br> (Constant value: 40)</p><h4 id="_185-pickit-config-failed" tabindex="-1">185. PICKIT_CONFIG_FAILED <a class="header-anchor" href="#_185-pickit-config-failed" aria-label="Permalink to &quot;185. PICKIT_CONFIG_FAILED&quot;">​</a></h4><p>This variable indicates that the specified configuration could not be successfully loaded for the PICK-IT return value.<br> (Constant value: 41)</p><h4 id="_186-pickit-build-bkg-cloud-ok" tabindex="-1">186. PICKIT_BUILD_BKG_CLOUD_OK <a class="header-anchor" href="#_186-pickit-build-bkg-cloud-ok" aria-label="Permalink to &quot;186. PICKIT_BUILD_BKG_CLOUD_OK&quot;">​</a></h4><p>This variable indicates that the background scene has been successfully constructed for the PICK-IT return value.<br> (Constant value: 60)</p><h4 id="_187-pickit-build-bkg-cloud-failed" tabindex="-1">187. PICKIT_BUILD_BKG_CLOUD_FAILED <a class="header-anchor" href="#_187-pickit-build-bkg-cloud-failed" aria-label="Permalink to &quot;187. PICKIT_BUILD_BKG_CLOUD_FAILED&quot;">​</a></h4><p>This variable indicates that the background scene could not be successfully constructed for the PICK-IT return value.<br> (Constant value: 61)</p><h4 id="_188-pickit-find-calib-plate-ok" tabindex="-1">188. PICKIT_FIND_CALIB_PLATE_OK <a class="header-anchor" href="#_188-pickit-find-calib-plate-ok" aria-label="Permalink to &quot;188. PICKIT_FIND_CALIB_PLATE_OK&quot;">​</a></h4><p>This variable indicates that the calibration plate has been successfully localized for the PICK-IT return value.<br> (Constant value: 10)</p><h4 id="_189-pickit-find-calib-plate-failed" tabindex="-1">189. PICKIT_FIND_CALIB_PLATE_FAILED <a class="header-anchor" href="#_189-pickit-find-calib-plate-failed" aria-label="Permalink to &quot;189. PICKIT_FIND_CALIB_PLATE_FAILED&quot;">​</a></h4><p>This variable indicates that the calibration plate could not be successfully localized for the PICK-IT return value.<br> (Constant value: 11)</p><h4 id="_190-pickit-save-snapshot-ok" tabindex="-1">190. PICKIT_SAVE_SNAPSHOT_OK <a class="header-anchor" href="#_190-pickit-save-snapshot-ok" aria-label="Permalink to &quot;190. PICKIT_SAVE_SNAPSHOT_OK&quot;">​</a></h4><p>This variable indicates that the snapshot has been successfully saved for the PICK-IT return value.<br> (Constant value: 50)</p><h4 id="_191-pickit-save-snapshot-failed" tabindex="-1">191. PICKIT_SAVE_SNAPSHOT_FAILED <a class="header-anchor" href="#_191-pickit-save-snapshot-failed" aria-label="Permalink to &quot;191. PICKIT_SAVE_SNAPSHOT_FAILED&quot;">​</a></h4><p>This variable indicates that the snapshot could not be successfully saved for the PICK-IT return value.<br> (Constant value: 51)</p><h4 id="_192-pickit-unknown-command" tabindex="-1">192. PICKIT_UNKNOWN_COMMAND <a class="header-anchor" href="#_192-pickit-unknown-command" aria-label="Permalink to &quot;192. PICKIT_UNKNOWN_COMMAND&quot;">​</a></h4><p>This variable means that the robot has sent an incorrect command to the vision system for the PICK-IT return value.<br> (Constant value: -99)</p><h4 id="_193-pickit-type-square" tabindex="-1">193. PICKIT_TYPE_SQUARE <a class="header-anchor" href="#_193-pickit-type-square" aria-label="Permalink to &quot;193. PICKIT_TYPE_SQUARE&quot;">​</a></h4><p>This variable indicates the square information of the detected object for the PICK-IT return value.<br> (Constant value: 21)</p><h4 id="_194-pickit-type-rectangle" tabindex="-1">194. PICKIT_TYPE_RECTANGLE <a class="header-anchor" href="#_194-pickit-type-rectangle" aria-label="Permalink to &quot;194. PICKIT_TYPE_RECTANGLE&quot;">​</a></h4><p>This variable indicates the rectangle information of the detected object for the PICK-IT return value.<br> (Constant value: 22)</p><h4 id="_195-pickit-type-circle" tabindex="-1">195. PICKIT_TYPE_CIRCLE <a class="header-anchor" href="#_195-pickit-type-circle" aria-label="Permalink to &quot;195. PICKIT_TYPE_CIRCLE&quot;">​</a></h4><p>This variable indicates the circle information of the detected object for the PICK-IT return value.<br> (Constant value: 23)</p><h4 id="_196-pickit-type-ellipse" tabindex="-1">196. PICKIT_TYPE_ELLIPSE <a class="header-anchor" href="#_196-pickit-type-ellipse" aria-label="Permalink to &quot;196. PICKIT_TYPE_ELLIPSE&quot;">​</a></h4><p>This variable indicates the ellipse information of the detected object for the PICK-IT return value.<br> (Constant value: 24)</p><h4 id="_197-pickit-type-cylinder" tabindex="-1">197. PICKIT_TYPE_CYLINDER <a class="header-anchor" href="#_197-pickit-type-cylinder" aria-label="Permalink to &quot;197. PICKIT_TYPE_CYLINDER&quot;">​</a></h4><p>This variable indicates the cylinder information of the detected object for the PICK-IT return value.<br> (Constant value: 32)</p><h4 id="_198-pickit-type-sphere" tabindex="-1">198. PICKIT_TYPE_SPHERE <a class="header-anchor" href="#_198-pickit-type-sphere" aria-label="Permalink to &quot;198. PICKIT_TYPE_SPHERE&quot;">​</a></h4><p>This variable indicates the sphere information of the detected object for the PICK-IT return value.<br> (Constant value: 33)</p><h4 id="_199-pickit-type-pointcloud" tabindex="-1">199. PICKIT_TYPE_POINTCLOUD <a class="header-anchor" href="#_199-pickit-type-pointcloud" aria-label="Permalink to &quot;199. PICKIT_TYPE_POINTCLOUD&quot;">​</a></h4><p>This variable indicates the point cloud information of the detected object for the PICK-IT return value.<br> (Constant value: 35)</p><h4 id="_200-pickit-type-blob" tabindex="-1">200. PICKIT_TYPE_BLOB <a class="header-anchor" href="#_200-pickit-type-blob" aria-label="Permalink to &quot;200. PICKIT_TYPE_BLOB&quot;">​</a></h4><p>This variable indicates the blob information of the detected object for the PICK-IT return value.<br> (Constant value: 50)</p><h4 id="_201-pickit-x" tabindex="-1">201. PICKIT_X <a class="header-anchor" href="#_201-pickit-x" aria-label="Permalink to &quot;201. PICKIT_X&quot;">​</a></h4><p>This variable indicates the X-axis value of the detected object for the PICK-IT return value.</p><h4 id="_202-pickit-y" tabindex="-1">202. PICKIT_Y <a class="header-anchor" href="#_202-pickit-y" aria-label="Permalink to &quot;202. PICKIT_Y&quot;">​</a></h4><p>This variable indicates the Y-axis value of the detected object for the PICK-IT return value.</p><h4 id="_203-pickit-z" tabindex="-1">203. PICKIT_Z <a class="header-anchor" href="#_203-pickit-z" aria-label="Permalink to &quot;203. PICKIT_Z&quot;">​</a></h4><p>This variable indicates the Z-axis value of the detected object for the PICK-IT return value.</p><h4 id="_204-pickit-rx" tabindex="-1">204. PICKIT_RX <a class="header-anchor" href="#_204-pickit-rx" aria-label="Permalink to &quot;204. PICKIT_RX&quot;">​</a></h4><p>This variable indicates the RX-axis value of the detected object for the PICK-IT return value.</p><h4 id="_205-pickit-ry" tabindex="-1">205. PICKIT_RY <a class="header-anchor" href="#_205-pickit-ry" aria-label="Permalink to &quot;205. PICKIT_RY&quot;">​</a></h4><p>This variable indicates the RY-axis value of the detected object for the PICK-IT return value.</p><h4 id="_206-pickit-rz" tabindex="-1">206. PICKIT_RZ <a class="header-anchor" href="#_206-pickit-rz" aria-label="Permalink to &quot;206. PICKIT_RZ&quot;">​</a></h4><p>This variable indicates the RZ-axis value of the detected object for the PICK-IT return value.</p><h4 id="_207-pickit-p" tabindex="-1">207. PICKIT_P# <a class="header-anchor" href="#_207-pickit-p" aria-label="Permalink to &quot;207. PICKIT_P#&quot;">​</a></h4><p>PICKIT_P0<br> PICKIT_P1<br> PICKIT_P2<br> PICKIT_P3<br> PICKIT_P4<br> PICKIT_P5<br></p><p>This variable represents the integer data of Payload # (0 to 5) received from the PickIt system for the PICK-IT return value.</p><h4 id="_208-pickit-p-f" tabindex="-1">208. PICKIT_P#F <a class="header-anchor" href="#_208-pickit-p-f" aria-label="Permalink to &quot;208. PICKIT_P#F&quot;">​</a></h4><p>PICKIT_P0F<br> PICKIT_P1F<br> PICKIT_P2F<br> PICKIT_P3F<br> PICKIT_P4F<br> PICKIT_P5F<br></p><p>This variable represents the float data of Payload # (0 to 5) received from the PickIt system for the PICK-IT return value.</p><h4 id="_209-pickit-m0" tabindex="-1">209. PICKIT_M0 <a class="header-anchor" href="#_209-pickit-m0" aria-label="Permalink to &quot;209. PICKIT_M0&quot;">​</a></h4><p>This variable represents the metadata 0 received from the PickIt system for the PICK-IT return value.</p><h4 id="_210-pickit-m1" tabindex="-1">210. PICKIT_M1 <a class="header-anchor" href="#_210-pickit-m1" aria-label="Permalink to &quot;210. PICKIT_M1&quot;">​</a></h4><p>This variable represents the metadata 1 received from the PickIt system for the PICK-IT return value.</p><h4 id="_211-ice-info-connected" tabindex="-1">211. ICE_INFO_CONNECTED <a class="header-anchor" href="#_211-ice-info-connected" aria-label="Permalink to &quot;211. ICE_INFO_CONNECTED&quot;">​</a></h4><p>This variable is used to check whether communication with the ice maker is active.</p><h4 id="_212-ice-info-requesting" tabindex="-1">212. ICE_INFO_REQUESTING <a class="header-anchor" href="#_212-ice-info-requesting" aria-label="Permalink to &quot;212. ICE_INFO_REQUESTING&quot;">​</a></h4><p>This variable is for internal developer use in RB.</p><h4 id="_213-ice-info-using" tabindex="-1">213. ICE_INFO_USING <a class="header-anchor" href="#_213-ice-info-using" aria-label="Permalink to &quot;213. ICE_INFO_USING&quot;">​</a></h4><p>This variable is for internal developer use in RB.</p><h4 id="_214-ice-info-vecsize" tabindex="-1">214. ICE_INFO_VECSIZE <a class="header-anchor" href="#_214-ice-info-vecsize" aria-label="Permalink to &quot;214. ICE_INFO_VECSIZE&quot;">​</a></h4><p>This variable is for internal developer use in RB.</p><h4 id="_215-ice-info-mode-comm" tabindex="-1">215. ICE_INFO_MODE_COMM <a class="header-anchor" href="#_215-ice-info-mode-comm" aria-label="Permalink to &quot;215. ICE_INFO_MODE_COMM&quot;">​</a></h4><p>This variable is used to check the communication mode with the ice maker.</p><ul><li>0: Normal mode</li><li>1: Communication mode</li></ul><h4 id="_216-ice-info-mode-cup" tabindex="-1">216. ICE_INFO_MODE_CUP <a class="header-anchor" href="#_216-ice-info-mode-cup" aria-label="Permalink to &quot;216. ICE_INFO_MODE_CUP&quot;">​</a></h4><p>This variable is used to respond to cup dislodgement.</p><ul><li>0: Prevent ice dispensing when cup is dislodged</li><li>1: Ignore cup dislodgement</li></ul><h4 id="_217-ice-info-time-ice" tabindex="-1">217. ICE_INFO_TIME_ICE <a class="header-anchor" href="#_217-ice-info-time-ice" aria-label="Permalink to &quot;217. ICE_INFO_TIME_ICE&quot;">​</a></h4><p>This variable indicates the last ice dispensing time.</p><h4 id="_218-ice-info-time-water" tabindex="-1">218. ICE_INFO_TIME_WATER <a class="header-anchor" href="#_218-ice-info-time-water" aria-label="Permalink to &quot;218. ICE_INFO_TIME_WATER&quot;">​</a></h4><p>This variable indicates the last water dispensing time.</p><h4 id="_219-ice-info-ambi-low" tabindex="-1">219. ICE_INFO_AMBI_LOW <a class="header-anchor" href="#_219-ice-info-ambi-low" aria-label="Permalink to &quot;219. ICE_INFO_AMBI_LOW&quot;">​</a></h4><p>This variable is used to check the lower limit of ambient temperature.</p><h4 id="_220-ice-info-ambi-high" tabindex="-1">220. ICE_INFO_AMBI_HIGH <a class="header-anchor" href="#_220-ice-info-ambi-high" aria-label="Permalink to &quot;220. ICE_INFO_AMBI_HIGH&quot;">​</a></h4><p>This variable is used to check the upper limit of ambient temperature.</p><h4 id="_221-ice-info-tmep-ambi" tabindex="-1">221. ICE_INFO_TMEP_AMBI <a class="header-anchor" href="#_221-ice-info-tmep-ambi" aria-label="Permalink to &quot;221. ICE_INFO_TMEP_AMBI&quot;">​</a></h4><p>This variable is used to check the current ambient temperature.</p><h4 id="_222-ice-info-tmep-evapo" tabindex="-1">222. ICE_INFO_TMEP_EVAPO <a class="header-anchor" href="#_222-ice-info-tmep-evapo" aria-label="Permalink to &quot;222. ICE_INFO_TMEP_EVAPO&quot;">​</a></h4><p>This variable is used to check the current evaporator temperature.</p><h4 id="_223-ice-info-tmep-conden" tabindex="-1">223. ICE_INFO_TMEP_CONDEN <a class="header-anchor" href="#_223-ice-info-tmep-conden" aria-label="Permalink to &quot;223. ICE_INFO_TMEP_CONDEN&quot;">​</a></h4><p>This variable is used to check the current condenser temperature.</p><h4 id="_224-ice-state-last-ice-no" tabindex="-1">224. ICE_STATE_LAST_ICE_NO <a class="header-anchor" href="#_224-ice-state-last-ice-no" aria-label="Permalink to &quot;224. ICE_STATE_LAST_ICE_NO&quot;">​</a></h4><p>This variable indicates that no ice was detected during the last dispensing.</p><h4 id="_225-ice-state-last-ice-yes" tabindex="-1">225. ICE_STATE_LAST_ICE_YES <a class="header-anchor" href="#_225-ice-state-last-ice-yes" aria-label="Permalink to &quot;225. ICE_STATE_LAST_ICE_YES&quot;">​</a></h4><p>This variable indicates that ice was detected during the last dispensing.</p><h4 id="_226-ice-state-comp-work" tabindex="-1">226. ICE_STATE_COMP_WORK <a class="header-anchor" href="#_226-ice-state-comp-work" aria-label="Permalink to &quot;226. ICE_STATE_COMP_WORK&quot;">​</a></h4><p>This variable indicates that the compressor is operating normally.</p><h4 id="_227-ice-state-motor-work" tabindex="-1">227. ICE_STATE_MOTOR_WORK <a class="header-anchor" href="#_227-ice-state-motor-work" aria-label="Permalink to &quot;227. ICE_STATE_MOTOR_WORK&quot;">​</a></h4><p>This variable indicates that the gear motor is operating normally.</p><h4 id="_228-ice-state-out-sol" tabindex="-1">228. ICE_STATE_OUT_SOL <a class="header-anchor" href="#_228-ice-state-out-sol" aria-label="Permalink to &quot;228. ICE_STATE_OUT_SOL&quot;">​</a></h4><p>This variable indicates that the dispensing solenoid is detected normally.</p><h4 id="_229-ice-state-cup-level" tabindex="-1">229. ICE_STATE_CUP_LEVEL <a class="header-anchor" href="#_229-ice-state-cup-level" aria-label="Permalink to &quot;229. ICE_STATE_CUP_LEVEL&quot;">​</a></h4><p>This variable indicates that the cup level is detected normally.</p><h4 id="_230-ice-state-comm-mode" tabindex="-1">230. ICE_STATE_COMM_MODE <a class="header-anchor" href="#_230-ice-state-comm-mode" aria-label="Permalink to &quot;230. ICE_STATE_COMM_MODE&quot;">​</a></h4><p>This variable indicates that the system is in communication mode.</p><h4 id="_231-ice-state-full-ice" tabindex="-1">231. ICE_STATE_FULL_ICE <a class="header-anchor" href="#_231-ice-state-full-ice" aria-label="Permalink to &quot;231. ICE_STATE_FULL_ICE&quot;">​</a></h4><p>This variable indicates that the ice bin is full.</p><h4 id="_232-ice-state-err-1-4" tabindex="-1">232. ICE_STATE_ERR_1~4 <a class="header-anchor" href="#_232-ice-state-err-1-4" aria-label="Permalink to &quot;232. ICE_STATE_ERR_1~4&quot;">​</a></h4><p>This variable is for internal developer use in RB.</p><h4 id="_233-ice-state-err-code" tabindex="-1">233. ICE_STATE_ERR_CODE <a class="header-anchor" href="#_233-ice-state-err-code" aria-label="Permalink to &quot;233. ICE_STATE_ERR_CODE&quot;">​</a></h4><p>This variable represents the error code, where 0 indicates normal operation.</p><h4 id="_234-ice-state-rd" tabindex="-1">234. ICE_STATE_RD <a class="header-anchor" href="#_234-ice-state-rd" aria-label="Permalink to &quot;234. ICE_STATE_RD&quot;">​</a></h4><p>This variable indicates the state of the ice maker.</p><ul><li>0: Dispensing complete &amp; timeout</li><li>1: Waiting for dispensing command</li></ul><h4 id="_235-setech-rdy" tabindex="-1">235. SETECH_RDY <a class="header-anchor" href="#_235-setech-rdy" aria-label="Permalink to &quot;235. SETECH_RDY&quot;">​</a></h4><p>This variable indicates the readiness state of the nut runner.</p><h4 id="_236-setech-alm" tabindex="-1">236. SETECH_ALM <a class="header-anchor" href="#_236-setech-alm" aria-label="Permalink to &quot;236. SETECH_ALM&quot;">​</a></h4><p>This variable indicates the presence of an alarm in the nut runner.</p><h4 id="_237-setech-busy" tabindex="-1">237. SETECH_BUSY <a class="header-anchor" href="#_237-setech-busy" aria-label="Permalink to &quot;237. SETECH_BUSY&quot;">​</a></h4><p>This variable indicates that the nut runner is currently fastening.</p><h4 id="_238-setech-comp" tabindex="-1">238. SETECH_COMP <a class="header-anchor" href="#_238-setech-comp" aria-label="Permalink to &quot;238. SETECH_COMP&quot;">​</a></h4><p>This variable indicates that fastening by the nut runner has been completed.</p><h4 id="_239-setech-ok" tabindex="-1">239. SETECH_OK <a class="header-anchor" href="#_239-setech-ok" aria-label="Permalink to &quot;239. SETECH_OK&quot;">​</a></h4><p>This variable indicates that the fastening has been completed successfully.</p><h4 id="_240-setech-ng-trqh" tabindex="-1">240. SETECH_NG_TRQH <a class="header-anchor" href="#_240-setech-ng-trqh" aria-label="Permalink to &quot;240. SETECH_NG_TRQH&quot;">​</a></h4><p>This variable indicates a NG (No Good) condition if the fastening torque exceeds the upper limit after completion.</p><h4 id="_241-setech-ng-trql" tabindex="-1">241. SETECH_NG_TRQL <a class="header-anchor" href="#_241-setech-ng-trql" aria-label="Permalink to &quot;241. SETECH_NG_TRQL&quot;">​</a></h4><p>This variable indicates a NG condition if the fastening torque is below the lower limit after completion.</p><h4 id="_242-setech-ng-angh" tabindex="-1">242. SETECH_NG_ANGH <a class="header-anchor" href="#_242-setech-ng-angh" aria-label="Permalink to &quot;242. SETECH_NG_ANGH&quot;">​</a></h4><p>This variable indicates a NG condition if the angle judgment result does not meet the upper range requirement after completion.</p><h4 id="_243-setech-ng-angl" tabindex="-1">243. SETECH_NG_ANGL <a class="header-anchor" href="#_243-setech-ng-angl" aria-label="Permalink to &quot;243. SETECH_NG_ANGL&quot;">​</a></h4><p>This variable indicates a NG condition if the angle judgment result does not meet the lower range requirement after completion.</p><h4 id="_244-setech-ng-time" tabindex="-1">244. SETECH_NG_TIME <a class="header-anchor" href="#_244-setech-ng-time" aria-label="Permalink to &quot;244. SETECH_NG_TIME&quot;">​</a></h4><p>This variable indicates a NG condition if the fastening time does not meet the upper or lower range requirement after completion.</p><h4 id="_245-setech-ng-moni" tabindex="-1">245. SETECH_NG_MONI <a class="header-anchor" href="#_245-setech-ng-moni" aria-label="Permalink to &quot;245. SETECH_NG_MONI&quot;">​</a></h4><p>This variable indicates a NG condition if the monitored torque judgment result does not meet the upper range requirement after completion.</p><h4 id="_246-setech-ng-ch1" tabindex="-1">246. SETECH_NG_CH1 <a class="header-anchor" href="#_246-setech-ng-ch1" aria-label="Permalink to &quot;246. SETECH_NG_CH1&quot;">​</a></h4><p>This variable indicates a NG condition when the channel selection input signal matches the current state.</p><h4 id="_247-setech-ng-ch2" tabindex="-1">247. SETECH_NG_CH2 <a class="header-anchor" href="#_247-setech-ng-ch2" aria-label="Permalink to &quot;247. SETECH_NG_CH2&quot;">​</a></h4><p>This variable indicates a NG condition when the channel selection input signal matches the current state.</p><h4 id="_248-setech-ng-ch4" tabindex="-1">248. SETECH_NG_CH4 <a class="header-anchor" href="#_248-setech-ng-ch4" aria-label="Permalink to &quot;248. SETECH_NG_CH4&quot;">​</a></h4><p>This variable indicates a NG condition when the channel selection input signal matches the current state.</p><h4 id="_249-setech-ng-ch8" tabindex="-1">249. SETECH_NG_CH8 <a class="header-anchor" href="#_249-setech-ng-ch8" aria-label="Permalink to &quot;249. SETECH_NG_CH8&quot;">​</a></h4><p>This variable indicates a NG condition when the channel selection input signal matches the current state.</p><h4 id="_250-setech-ng-ch16" tabindex="-1">250. SETECH_NG_CH16 <a class="header-anchor" href="#_250-setech-ng-ch16" aria-label="Permalink to &quot;250. SETECH_NG_CH16&quot;">​</a></h4><p>This variable indicates a NG condition when the channel selection input signal matches the current state.</p><h4 id="_251-sd-no-arc-state" tabindex="-1">251. SD_NO_ARC_STATE <a class="header-anchor" href="#_251-sd-no-arc-state" aria-label="Permalink to &quot;251. SD_NO_ARC_STATE&quot;">​</a></h4><p>This variable indicates whether the NO_ARC function is enabled during welding operations.</p><h4 id="_252-sd-dweld-arc" tabindex="-1">252. SD_DWELD_ARC <a class="header-anchor" href="#_252-sd-dweld-arc" aria-label="Permalink to &quot;252. SD_DWELD_ARC&quot;">​</a></h4><p>This variable indicates the state of arc generation in the digital welder.</p><h4 id="_253-sd-dweld-touch" tabindex="-1">253. SD_DWELD_TOUCH <a class="header-anchor" href="#_253-sd-dweld-touch" aria-label="Permalink to &quot;253. SD_DWELD_TOUCH&quot;">​</a></h4><p>This variable indicates the touch state of the digital welder.</p><h4 id="_254-sd-dweld-a" tabindex="-1">254. SD_DWELD_A <a class="header-anchor" href="#_254-sd-dweld-a" aria-label="Permalink to &quot;254. SD_DWELD_A&quot;">​</a></h4><p>This variable indicates the current value of the digital welder.</p><h4 id="_255-sd-dweld-v" tabindex="-1">255. SD_DWELD_V <a class="header-anchor" href="#_255-sd-dweld-v" aria-label="Permalink to &quot;255. SD_DWELD_V&quot;">​</a></h4><p>This variable indicates the voltage value of the digital welder.</p><h4 id="_256-sd-dweld-f" tabindex="-1">256. SD_DWELD_F <a class="header-anchor" href="#_256-sd-dweld-f" aria-label="Permalink to &quot;256. SD_DWELD_F&quot;">​</a></h4><p>This variable indicates the feeder speed value of the digital welder.</p><h4 id="_257-sd-dweld-set-a" tabindex="-1">257. SD_DWELD_SET_A <a class="header-anchor" href="#_257-sd-dweld-set-a" aria-label="Permalink to &quot;257. SD_DWELD_SET_A&quot;">​</a></h4><p>This variable indicates the set current value of the digital welder.</p><h4 id="_258-sd-conv-pos-tick" tabindex="-1">258. SD_CONV_POS_TICK <a class="header-anchor" href="#_258-sd-conv-pos-tick" aria-label="Permalink to &quot;258. SD_CONV_POS_TICK&quot;">​</a></h4><p>This variable indicates the position tick of the conveyor.</p><h4 id="_259-sd-conv-vel-tick" tabindex="-1">259. SD_CONV_VEL_TICK <a class="header-anchor" href="#_259-sd-conv-vel-tick" aria-label="Permalink to &quot;259. SD_CONV_VEL_TICK&quot;">​</a></h4><p>This variable indicates the speed tick of the conveyor.</p>',572),n=[o];function h(s,l,_,d,c,b){return t(),a("div",null,n)}const m=e(r,[["render",h]]);export{u as __pageData,m as default};
